(5, 3, 1697114643, 'Contao Example Event', 0, 'contao-example-event', 3, 1, 1691481600, 1691607600, 1691452800, 1691539200, '', '', NULL, '', '', '<p>Save the Date for this example event!</p>', 0, 0, 0x00000000000000000000000000000000, '', '', '', '', 0, '', '', 1, 'a:2:{s:4:\"unit\";s:5:\"years\";s:5:\"value\";s:1:\"1\";}', 4294967295, 0, 0, '', 'default', 0, 0, '', 0, '', 0, 1, '', '', '', ''),
(6, 3, 1727865826, 'Contao North-Day', 0, 'contao-north-day', 1, 0, 1517011200, 1517097599, 1517011200, NULL, '', '', NULL, '', '', '<p>The Contao North-Day is an event dedicated to Contao users, developers and supportes situated in the north of Germany. The event started in 2013 and takes place in Hamburg. In a series of presentations participants get the chance to learn from first hand experience from expterts of varying fields and to expand their horizons in the website development context. &nbsp;</p>', 1, 1, 0x00000000000000000000000000000000, '', '', '', '', 0, '', '', 1, 'a:2:{s:4:\"unit\";s:5:\"years\";s:5:\"value\";s:1:\"1\";}', 4294967295, 0, 0, '', 'external', 0, 0, 'https://2018.nordtag.contao.org/', 1, '', 0, 1, '', '', '', ''),
(7, 3, 1697114265, 'Annual Contao Conference', 0, 'annual-contao-conference', 3, 0, 1697328000, 1697414399, 1697328000, NULL, '', 'index,follow', NULL, 'changing locations all over europe', 'address: see actual conference location', '<p>The official Contao Conference had its debut in 2011 and has been held each year since. During the 2-day event developers, users and supporters meet up to attain workshops and presentations, share knowledge and to network.</p>', 0, 0, 0x00000000000000000000000000000000, '', '', '', '', 0, '', '', 1, 'a:2:{s:4:\"unit\";s:5:\"years\";s:5:\"value\";s:1:\"1\";}', 4294967295, 0, 0, '', 'default', 0, 0, '', 0, '', 0, 1, '', '', '', ''),
(8, 3, 1697114548, 'Contao Camp', 0, 'contao-camp-2023', 1, 0, 1683331200, 1683503999, 1683331200, 1683417600, '', '', NULL, '', '', '<p>The Contao Camp 2023 takes place in Regensburg, Germany.</p>', 0, 0, 0x00000000000000000000000000000000, '', '', '', '', 0, '', '', 1, 'a:2:{s:4:\"unit\";s:5:\"years\";s:5:\"value\";s:1:\"1\";}', 4294967295, 0, 0, '', 'default', 0, 0, '', 0, '', 0, 1, '', '', '', ''),
(9, 4, 1730460696, 'Contemporary Art', 0, 'contemporary-art', 8, 0, 1730415600, 1730588399, 1730415600, 1730502000, '', '', NULL, 'Artspire Gallery', 'Berlin 3123, 43', '<p>A dynamic exploration of the modern world, this collection includes works from the past few decades that challenge traditional boundaries. Pieces reflect the complexities of today&#39;s culture, emotions, and experiences.</p>', 1, 0, 0x05cb1f82983f11ef92c7a8a1598b245a, '', '', 'a:3:{i:0;s:0:\"\";i:1;s:0:\"\";i:2;s:1:\"5\";}', '', 0, '', 'above', 0, '', 0, 0, 0, NULL, 'default', 0, 0, '', 0, '', 0, 1, '', '', '', ''),
(10, 6, 1730830868, 'Digital Renaissance Art', 0, 'digital-renaissance-art', 5, 0, 1730415600, 1730501999, 1730415600, NULL, '', '', NULL, 'The Creative Loft', 'Wien 1010, Seitengasse 4', '<p><em>Description:</em> A collection of works created using digital technology, showcasing innovative practices that push the boundaries of traditional media. Digital art includes graphics, animations, and algorithmic creations that engage viewers in new ways.<br><em>Exhibit Status:</em> <strong>Limited Exhibits Available</strong></p>', 1, 0, 0x3bb7db9b983b11ef92c7a8a1598b245a, '', '', 'a:3:{i:0;s:0:\"\";i:1;s:0:\"\";i:2;s:1:\"5\";}', '', 0, '', 'above', 0, '', 0, 0, 0, NULL, 'default', 0, 0, '', 0, '', 0, 1, '', '', '', ''),
(11, 7, 1731940967, 'Impressionism', 0, 'impressionism', 6, 0, 1730502000, 1730588399, 1730502000, NULL, '', '', NULL, 'zs art galerie', 'Westbahnstraße 27/29', '<p>Impressionism is a 19th-century art movement characterized by small, thin, visible brush strokes, open composition, and an emphasis on the accurate depiction of light and its changing qualities. It often focuses on ordinary scenes and landscapes with vibrant, natural colors.</p>', 1, 0, 0x1b1eb42f983c11ef92c7a8a1598b245a, '', '', 'a:3:{i:0;s:0:\"\";i:1;s:0:\"\";i:2;s:1:\"5\";}', '', 0, '', 'above', 0, '', 0, 0, 0, NULL, 'default', 0, 0, '', 0, '', 0, 1, '', '', '', ''),
(13, 6, 1730830859, 'Installation Art', 0, 'installation-art', 5, 0, 1732402800, 1732489199, 1732402800, NULL, '', '', NULL, 'The Creative Loft', 'Wien 1010, Seitengasse 4', '<p><em>Description:</em> Immersive artworks designed to transform space, engaging viewers in a multi-sensory experience. This category often incorporates various materials and mediums to create interactive environments that invite exploration and reflection.<br><em>Exhibit Status:</em> <strong>Now Open</strong></p>', 1, 0, 0x3bc4d61e983b11ef92c7a8a1598b245a, '', '', 'a:3:{i:0;s:0:\"\";i:1;s:0:\"\";i:2;s:1:\"5\";}', '', 0, '', 'above', 0, '', 0, 0, 0, NULL, 'default', 0, 0, '', 0, '', 0, 1, '', '', '', ''),
(14, 6, 1730828543, 'Mixed Media', 0, 'mixed-media', 5, 0, 1730502000, 1730588399, 1730502000, NULL, '', '', NULL, 'The Creative Loft', 'Wien 1010, Seitengasse 4', '<p><em>Description:</em> Artworks that combine different artistic techniques and materials, allowing for complex expression. This category encourages artists to blend painting, collage, sculpture, and other forms to create dynamic pieces that defy traditional categorization.<br><em>Exhibit Status:</em> <strong>Now Open</strong></p>', 1, 0, 0x3bb35a80983b11ef92c7a8a1598b245a, '', '', 'a:3:{i:0;s:0:\"\";i:1;s:0:\"\";i:2;s:1:\"5\";}', '', 0, '', 'above', 0, '', 0, 0, 0, NULL, 'default', 0, 0, '', 0, '', 0, 1, '', '', '', ''),
(15, 6, 1730830855, 'Contemporary Painting', 0, 'contemporary-painting', 5, 0, 1733266800, 1733353199, 1733266800, NULL, '', '', NULL, 'The Creative Loft', 'Wien 1010, Seitengasse 4', '<p><em>Description:</em> A vibrant selection of paintings reflecting current trends and ideas in the art world. This category features various styles and techniques, from abstract to figurative, showcasing the evolving nature of contemporary art.<br><em>Exhibit Status:</em> <strong>Now Open</strong></p>', 1, 0, 0xcfaf463b984611ef92c7a8a1598b245a, '', '', 'a:3:{i:0;s:0:\"\";i:1;s:0:\"\";i:2;s:1:\"5\";}', '', 0, '', 'above', 0, '', 0, 0, 0, NULL, 'default', 0, 0, '', 0, '', 0, 1, '', '', '', ''),
(16, 7, 1731940955, 'Contemporary Art: Closed', 0, 'contemporary-art-2', 6, 0, 1731452400, 1731538799, 1731452400, NULL, '', '', NULL, 'Maya Galerie Wien', 'Burggasse 89', '<p>Contemporary art encompasses art created in the late 20th and 21st centuries, reflecting current cultural, political, and social contexts. It often incorporates diverse mediums, innovative techniques, and interdisciplinary approaches.</p>', 1, 0, 0x2159e32f983c11ef92c7a8a1598b245a, '', '', 'a:3:{i:0;s:0:\"\";i:1;s:0:\"\";i:2;s:1:\"5\";}', '', 0, '', 'above', 0, '', 0, 0, 0, NULL, 'default', 0, 0, '', 0, '', 0, 1, '', '', '', ''),
(17, 7, 1731940961, 'Abstract Art', 0, 'abstract-art', 6, 0, 1731279600, 1731365999, 1731279600, NULL, '', '', NULL, 'Amart Austrian Modern Art - Galerie für moderne Kunst', 'Halbgasse 17', '<p>Abstract art moves away from realistic depictions, focusing instead on shapes, colors, and forms to convey emotions or ideas. It emphasizes the subjective interpretation of the viewer and often lacks a direct representation of the physical world.</p>', 1, 0, 0x2b21c647983c11ef92c7a8a1598b245a, '', '', 'a:3:{i:0;s:0:\"\";i:1;s:0:\"\";i:2;s:1:\"5\";}', '', 0, '', 'above', 0, '', 0, 0, 0, NULL, 'default', 0, 0, '', 0, '', 0, 1, '', '', '', ''),
(18, 6, 1731941745, 'Sculpture', 0, 'sculpture', 5, 0, 1735686000, 1735772399, 1735686000, NULL, '', '', NULL, 'The Creative Loft', 'Wien 1010, Seitengasse 4', '<p><em>Description:</em> Three-dimensional works that explore form and space, using a variety of materials such as metal, wood, clay, and found objects. This category includes both traditional and contemporary sculptures, highlighting the versatility of the medium.<br><em>Exhibit Status:</em> <strong>Now Open</strong></p>', 1, 0, 0x4c4407b7a5bc11ef92c7a8a1598b245a, '', '', 'a:3:{i:0;s:0:\"\";i:1;s:0:\"\";i:2;s:1:\"5\";}', '', 0, '', 'above', 0, '', 0, 0, 0, NULL, 'default', 0, 0, '', 0, '', 0, 1, '', '1731164100', '', ''),
(19, 4, 1730461703, 'Abstract Art', 0, 'abstract-art-2', 8, 0, 1730761200, 1730847599, 1730761200, NULL, '', '', NULL, 'Artspire Gallery', 'Berlin 3123, 43', '<p>This category celebrates freedom of expression through color, form, and line without traditional representations. Each piece invites viewers to interpret its meaning, encouraging a personal connection with the artwork.</p>', 1, 0, 0x08a6f874984711ef92c7a8a1598b245a, '', '', 'a:3:{i:0;s:0:\"\";i:1;s:0:\"\";i:2;s:1:\"5\";}', '', 0, '', 'above', 0, '', 0, 0, 0, NULL, 'default', 0, 0, '', 0, '', 0, 1, '', '', '', ''),
(20, 7, 1731940950, 'Sculpture: Limited exhibition', 0, 'sculpture-2', 6, 0, 1731798000, 1731884399, 1731798000, NULL, '', '', NULL, 'galerie artziwna', 'Herrengasse 17', '<p>Sculpture is a three-dimensional art form that involves shaping materials such as stone, metal, clay, or wood. Sculptures can be freestanding, relief, or kinetic, ranging from classical styles to modern and abstract expressions.</p>', 1, 0, 0x2841459e984711ef92c7a8a1598b245a, '', '', 'a:3:{i:0;s:0:\"\";i:1;s:0:\"\";i:2;s:1:\"5\";}', '', 0, '', 'above', 0, '', 0, 0, 0, NULL, 'default', 0, 0, '', 0, '', 0, 1, '', '', '', ''),
(21, 6, 1731941015, 'Interactive Media', 0, 'interactive-media', 5, 0, 1735426800, 1735513199, 1735426800, NULL, '', '', NULL, 'The Creative Loft', 'Wien 1010, Seitengasse 4', '<p><em>Description:</em> Engaging artworks that invite audience participation, utilizing technology and interactivity to create a dynamic relationship between the viewer and the art. This category fosters collaboration and encourages exploration through innovative means.<br><em>Exhibit Status:</em> <strong>Sold Out</strong></p>', 1, 0, 0x0850940d984711ef92c7a8a1598b245a, '', '', 'a:3:{i:0;s:0:\"\";i:1;s:0:\"\";i:2;s:1:\"5\";}', '', 0, '', 'above', 0, '', 0, 0, 0, NULL, 'default', 0, 0, '', 0, '', 0, 1, '', '', '', ''),
(22, 7, 1731940944, 'Photography', 0, 'photography', 6, 0, 1732230000, 1732316399, 1732230000, NULL, '', '', NULL, 'Galerie 10', 'Getreidemarkt 10', '<p>Photography is the art of capturing moments through a camera lens. It can range from documentary and portrait photography to fine art and conceptual works, exploring composition, light, and storytelling.</p>', 1, 0, 0x6a7c4eb9984711ef92c7a8a1598b245a, '', '', 'a:3:{i:0;s:0:\"\";i:1;s:0:\"\";i:2;s:1:\"5\";}', '', 0, '', 'above', 0, '', 0, 0, 0, NULL, 'default', 0, 0, '', 0, '', 0, 1, '', '', '', ''),
