(19, 'text', 13, 'tl_article', 64, 1400067331, 'a:2:{s:4:\"unit\";s:2:\"h1\";s:5:\"value\";s:18:\"Not authenticated!\";}', '<p>You are not allowed to access the requested page!</p>\n<p>Maybe you are not logged in correctly?</p>\n<p>If a user tries to access a protected page without permission, a special <strong>error_401</strong> page will be called. In this case you can either display an error message (like we are doing now) by simply creating an article on this page, or you can redirect the user to another page (e.g. the welcome page).</p>\n<p>Accordingly, if a user tries to access a page that does not exist, a special <strong>error_404</strong> page will be called. Again, you can either display an error message or redirect the user to another page.</p>', 0, 0, 0, 0, NULL, '', '', 'a:2:{i:0;s:0:\"\";i:1;s:0:\"\";}', '', 0, '', '', '', 'ordered', 0x613a313a7b693a303b733a303a22223b7d, 0x613a313a7b693a303b613a313a7b693a303b733a303a22223b7d7d, '', 0, 0, 0, 0, 0, '', '', '', '', '', 'sourceText', '', '', 0, 0, '', '', '', '', 0, '', 0, 4, 0, 0, '', 0, '', '', NULL, '', '', 0x00000000000000000000000000000000, '', NULL, '0', '0', '', '', 0, '', '', NULL, NULL, 0, 300, 0, 0, NULL, 0, 0, 0, 0, 0, 0, NULL, 'a:2:{i:0;s:0:\"\";i:1;s:0:\"\";}', 0, '', '', '', 0, 0, 0, 0, 0, '', NULL, 0, '', NULL, 'en', NULL, '', '', '', ''),
(21, 'text', 14, 'tl_article', 128, 1195928133, 'a:2:{s:4:\"unit\";s:2:\"h1\";s:5:\"value\";s:24:\"Your data has been saved\";}', 'You can cross-check the changes you have made in the back end (module \"members\"). Select {{user::firstname}} {{user::lastname}} and take a closer look at the record.<br />\n<br />\n{{link::back}}\n', 0, 0, 0, 0, NULL, '', '', '', '', 0, '', '', '', '', '', '', '', 0, 0, 0, 0, 0, '', '', '', '', '', 'sourceText', '', '', 0, 0, '', '', '', '', 0, '', 0, 4, 0, 0, '', 0, '', '', NULL, '', '', 0x00000000000000000000000000000000, '', NULL, '0', '0', '', '', 0, '', '', NULL, NULL, 0, 300, 0, 0, NULL, 0, 0, 0, 0, 0, 0, NULL, 'a:2:{i:0;s:0:\"\";i:1;s:0:\"\";}', 0, '', '', '', 0, 0, 0, 0, 0, '', NULL, 0, '', NULL, 'en', NULL, '', '', '', ''),
