(46, 'text', 89, 'tl_article', 16, 1697113571, 'a:2:{s:4:\"unit\";s:2:\"h2\";s:5:\"value\";s:10:\"Learn more\";}', '<p>On the following pages you will get a brief introduction into the basics of Contao. We can not explain each and every possibility Contao has to offer, but you will get the essential information and a first glimpse of what this CMS can do.</p>\n<p>What about some basics on <a href=\"{{link_url::63|urlattr}}\">Navigation</a>. Also a straight forward <a href=\"{{link_url::59|urlattr}}\">Calendar</a> is on board.</p>\n<p class=\"button-group\"><a href=\"{{link_url::48|urlattr}}\" class=\"button-secondary button--md\">Content Elements</a> <a href=\"{{link_url::49|urlattr}}\" class=\"button-secondary button--md\">Modules</a></p>\n<p>There is a lot more to discover in this demo. <br>Make sure you also visit&nbsp;<a rel=\"noopener\" href=\"https://contao.org\" target=\"_blank\">https://contao.org</a>&nbsp;for more information.</p>', 0, 0, 0, 0, NULL, '', '', '', '', 0, '', '', '', '', '', '', '', 0, 0, 0, 0, 0, '', '', '', '', '', 'sourceText', '', '', 0, 0, '', '', '', '', 0, '', 0, 4, 0, 0, '', 0, '', '', NULL, '', '', 0x00000000000000000000000000000000, '', NULL, '0', '0', '', '', 0, '', '', NULL, NULL, 0, 300, 0, 0, NULL, 0, 0, 0, 0, 0, 0, NULL, 'a:2:{i:0;s:0:\"\";i:1;s:5:\"col-6\";}', 0, '', '', '', 0, 0, 0, 0, 0, '', NULL, 0, '', NULL, 'en', NULL, '', '', '', ''),
