(52, 'text', 19, 'tl_article', 128, 1697114608, 'a:2:{s:4:\"unit\";s:2:\"h1\";s:5:\"value\";s:6:\"Events\";}', '<p class=\"text--lg\">Here are some examples on how the calendar modules can be used. You can either use a big calendar view, a mini-calender as shown on the left side below the vertical navigation or an event-list shown at the bottom of the page. All of those offer you different options of with what, where, when and how to display the calendar.</p>\n<p>To see some actual calendar entries <a href=\"{{link_url::59|urlattr}}?month=202310\" title=\"October 2023\">click here to go to October 2023.</a></p>', 0, 0, 0, 0, NULL, '', '', '', '', 0, '', '', NULL, '', NULL, NULL, '', 0, 0, 0, 0, 0, '', '', '', '', '', 'sourceText', NULL, '', 0, 0, '', '', '', '', 0, NULL, 0, 4, 0, 0, '', 0, '', '', NULL, '', '', 0x00000000000000000000000000000000, '', NULL, '0', '0', '', '', 0, '', '', NULL, NULL, 0, 300, 0, 0, NULL, 0, 0, 0, 0, 0, 0, NULL, 'a:2:{i:0;s:0:\"\";i:1;s:0:\"\";}', 0, '', '', '', 0, 0, 0, 0, 0, '', NULL, 0, '', NULL, 'en', NULL, '', '', '', ''),
