(55, 'text', 19, 'tl_article', 384, 1682527883, 'a:2:{s:4:\"unit\";s:2:\"h2\";s:5:\"value\";s:15:\"List all events\";}', '<p>And here you see the event list. Events can be listed drawing from one or more categories that can be set up in the back end. Here is a short list of options that go along with every event. <a href=\"{{link_url::23|urlattr}}?month=201001\" title=\"List all events\"><br></a></p>\n<ul>\n<li>Start date and end date</li>\n<li>Start time and end time</li>\n<li>Repeat event (recurring)</li>\n<li>Add a picture or enclosures</li>\n<li>Disable comments (if enabled for events)</li>\n</ul>', 0, 0, 0, 0, NULL, '', '', '', '', 0, '', '', NULL, '', NULL, NULL, '', 0, 0, 0, 0, 0, '', '', '', '', '', 'sourceText', NULL, '', 0, 0, '', '', '', '', 0, NULL, 0, 4, 0, 0, '', 0, '', '', NULL, '', '', 0x00000000000000000000000000000000, '', NULL, '0', '0', '', '', 0, '', '', NULL, NULL, 0, 300, 0, 0, NULL, 0, 0, 0, 0, 0, 0, NULL, 'a:2:{i:0;s:0:\"\";i:1;s:12:\"divider--top\";}', 0, '', '', '', 0, 0, 0, 0, 0, '', NULL, 0, '', NULL, 'en', NULL, '', '', '', ''),
