(123, 'text', 76, 'tl_article', 128, 1680539945, 'a:2:{s:4:\"unit\";s:2:\"h1\";s:5:\"value\";s:10:\"Newsletter\";}', '<p class=\"text--lg\">Contao offers you an easy way to manage newsletters and subscribers. With four modules you are able to handle the processes of subscription, unsubscription and the viewing of past newsletters on your website.</p>\n<ul>\n<li>Newsletter subscribe</li>\n<li>Newsletter unsubscribe</li>\n<li>Newsletter list</li>\n<li>Newsletter reader</li>\n</ul>\n<p>You can offer visitors or user groups the possibility to subscribe to different channels.</p>', 0, 0, 0, 0, NULL, '', '', '', '', 0, '', '', NULL, '', NULL, NULL, '', 0, 0, 0, 0, 0, 'ascending', '', '', '', '', 'sourceText', NULL, '', 0, 0, '', '', '', '', 0, NULL, 0, 4, 0, 0, '', 0, '', '', NULL, '', '', 0x00000000000000000000000000000000, '', NULL, '0', '0', '', '', 0, '', '', NULL, NULL, 0, 300, 0, 0, NULL, 0, 0, 0, 0, 0, 0, NULL, 'a:2:{i:0;s:0:\"\";i:1;s:0:\"\";}', 0, '', '', 'ascending', 0, 0, 0, 0, 0, 'com_default', NULL, 0, '', NULL, 'en', NULL, '', '', '', ''),
