(141, 'text', 36, 'tl_article', 64, 1680541162, 'a:2:{s:4:\"unit\";s:2:\"h1\";s:5:\"value\";s:5:\"Login\";}', '<p class=\"text--lg\">Now let&#39;s get to the heart of Contao. Below you&#39;ll find login data for different members and user groups. &#34;Members&#34; in Contao refer to people that have access to the frontend of your website. On the other hand we have &#34;Users&#34; who are &nbsp;people that have access to the back end and are usually divided into administrators or editors.</p>\n<p>But Contao lets you create all kinds of groups with everyone having its own access rights. You can allow frontend members to read just certain pages, access chosen forms or to be allowed to interact just with defined modules. Nearly everything in Contao has an access level parameter.</p>\n<p>And the same goes for the back end users. Create one group that has only the right to edit calendar entries, another one that is only allowed to write articles and a third one that has access to both.</p>', 0, 0, 0, 0, NULL, '', '', '', '', 0, '', '', NULL, '', NULL, NULL, '', 0, 0, 0, 0, 0, '', '', '', '', '', 'sourceText', NULL, '', 0, 0, '', '', '', '', 0, NULL, 0, 4, 0, 0, '', 0, '', '', NULL, '', '', 0x00000000000000000000000000000000, '', NULL, '0', '0', '', '', 0, '', '', NULL, NULL, 0, 300, 0, 0, NULL, 0, 0, 0, 0, 0, 0, NULL, 'a:2:{i:0;s:0:\"\";i:1;s:0:\"\";}', 0, '', '', '', 0, 0, 0, 0, 0, '', NULL, 0, '', NULL, 'en', NULL, '', '', '', ''),
