(150, 'text', 81, 'tl_article', 128, 1680539880, 'a:2:{s:4:\"unit\";s:2:\"h1\";s:5:\"value\";s:16:\"Navigation menus\";}', '<p class=\"text--lg\">Contao offers you great freedom when it comes to creating navigations on a website. Eight different modules with their own options help you to cover almost every way you could think of to lead visitors to the information they are looking for. A big part of the navigation of a site tree based CMS with nested pages is the concept of start and stop levels.</p>\n<p>Let&#39;s try to get a little insight into this concept and explain what can be accomplished with Contao.</p>', 0, 0, 0, 0, NULL, '', '', '', '', 0, '', '', NULL, '', NULL, NULL, '', 0, 0, 0, 0, 0, '', '', '', '', '', 'sourceText', NULL, '', 0, 0, '', '', '', '', 0, NULL, 0, 4, 0, 0, '', 0, '', '', NULL, '', '', 0x00000000000000000000000000000000, '', NULL, '0', '0', '', '', 0, '', '', NULL, NULL, 0, 300, 0, 0, NULL, 0, 0, 0, 0, 0, 0, NULL, 'a:2:{i:0;s:0:\"\";i:1;s:0:\"\";}', 0, '', '', '', 0, 0, 0, 0, 0, '', NULL, 0, '', NULL, 'en', NULL, '', '', '', ''),
(151, 'text', 81, 'tl_article', 256, 1366743464, 'a:2:{s:4:\"unit\";s:2:\"h2\";s:5:\"value\";s:22:\"Example site structure\";}', '<ul>\n<li>Home</li>\n<li>Music\n<ul>\n<li>Genres\n<ul>\n<li>Rock</li>\n<li>Pop</li>\n</ul>\n</li>\n<li>Artists\n<ul>\n<li>Mrs. X</li>\n<li>Mrs. Y</li>\n</ul>\n</li>\n</ul>\n</li>\n<li>Movies\n<ul>\n<li>Genres\n<ul>\n<li>Action</li>\n<li>Fantasy</li>\n</ul>\n</li>\n<li>Actors\n<ul>\n<li>Mr. X</li>\n<li>Mr. Y</li>\n</ul>\n</li>\n</ul>\n</li>\n<li>Contact</li>\n</ul>', 0, 0, 0, 0, NULL, '', '', '', '', 0, '', '', NULL, '', NULL, NULL, '', 0, 0, 0, 0, 0, '', '', '', '', '', 'sourceText', NULL, '', 0, 0, '', '', '', '', 0, NULL, 0, 4, 0, 0, '', 0, '', '', NULL, '', '', 0x00000000000000000000000000000000, '', NULL, '0', '0', '', '', 0, '', '', NULL, NULL, 0, 300, 0, 0, NULL, 0, 0, 0, 0, 0, 0, NULL, 'a:2:{i:0;s:0:\"\";i:1;s:0:\"\";}', 0, '', '', '', 0, 0, 0, 0, 0, '', NULL, 0, '', NULL, 'en', NULL, '', '', '', ''),
(152, 'text', 81, 'tl_article', 384, 1682527772, 'a:2:{s:4:\"unit\";s:2:\"h2\";s:5:\"value\";s:23:\"Default navigation menu\";}', '<p>By default, the navigation menu module simply displays the whole site structure. Whenever you add a page to the site tree it will automatically appear in this list.</p>', 0, 0, 0, 0, NULL, '', '', '', '', 0, '', '', NULL, '', NULL, NULL, '', 0, 0, 0, 0, 0, '', '', '', '', '', 'sourceText', NULL, '', 0, 0, '', '', '', '', 0, NULL, 0, 4, 0, 0, '', 0, '', '', NULL, '', '', 0x00000000000000000000000000000000, '', NULL, '0', '0', '', '', 0, '', '', NULL, NULL, 0, 300, 0, 0, NULL, 0, 0, 0, 0, 0, 0, NULL, 'a:2:{i:0;s:0:\"\";i:1;s:29:\"divider--top sibling-space--2\";}', 0, '', '', '', 0, 0, 0, 0, 0, '', NULL, 0, '', NULL, 'en', NULL, '', '', '', ''),
(153, 'text', 81, 'tl_article', 512, 1682527757, 'a:2:{s:4:\"unit\";s:2:\"h2\";s:5:\"value\";s:19:\"Stop level set to 1\";}', '<p>If you set the stop level to 1, the navigation menu will only display the first level and all activated pages. Here is what the navigation menu looks like when you are viewing the page Music -&gt; Genres -&gt; Pop.</p>\n<ul>\n<li>Home</li>\n<li>Music\n<ul>\n<li>Genres\n<ul>\n<li>Pop</li>\n<li>Rock</li>\n</ul>\n</li>\n</ul>\n</li>\n<li>Movies</li>\n<li>Contact</li>\n</ul>', 0, 0, 0, 0, NULL, '', '', '', '', 0, '', '', NULL, '', NULL, NULL, '', 0, 0, 0, 0, 0, '', '', '', '', '', 'sourceText', NULL, '', 0, 0, '', '', '', '', 0, NULL, 0, 4, 0, 0, '', 0, '', '', NULL, '', '', 0x00000000000000000000000000000000, '', NULL, '0', '0', '', '', 0, '', '', NULL, NULL, 0, 300, 0, 0, NULL, 0, 0, 0, 0, 0, 0, NULL, 'a:2:{i:0;s:0:\"\";i:1;s:16:\"sibling-space--2\";}', 0, '', '', '', 0, 0, 0, 0, 0, '', NULL, 0, '', NULL, 'en', NULL, '', '', '', ''),
(154, 'text', 81, 'tl_article', 640, 1682527757, 'a:2:{s:4:\"unit\";s:2:\"h2\";s:5:\"value\";s:28:\"Stop level 1 with hard limit\";}', '<p>If you want to display even less pages in the navigation menu, you choose the new option \"hard limit\". That way the navigation menu never shows any page beyond the stop level no matter wether they are activated or not. The ouput is exacly the same as with the \"navigation main menu items\" module. However, by being able to set a stop level of your choosing, you are not limited to the first level anymore as with the \"navigation main menu items\" module!</p>\n<ul>\n<li>Home</li>\n<li>Music</li>\n<li>Movies</li>\n<li>Contact</li>\n</ul>', 0, 0, 0, 0, NULL, '', '', '', '', 0, '', '', NULL, '', NULL, NULL, '', 0, 0, 0, 0, 0, '', '', '', '', '', 'sourceText', NULL, '', 0, 0, '', '', '', '', 0, NULL, 0, 4, 0, 0, '', 0, '', '', NULL, '', '', 0x00000000000000000000000000000000, '', NULL, '0', '0', '', '', 0, '', '', NULL, NULL, 0, 300, 0, 0, NULL, 0, 0, 0, 0, 0, 0, NULL, 'a:2:{i:0;s:0:\"\";i:1;s:16:\"sibling-space--2\";}', 0, '', '', '', 0, 0, 0, 0, 0, '', NULL, 0, '', NULL, 'en', NULL, '', '', '', ''),
(155, 'text', 81, 'tl_article', 768, 1682527757, 'a:2:{s:4:\"unit\";s:2:\"h2\";s:5:\"value\";s:28:\"Stop level 2 with hard limit\";}', '<p>A lot of people have requested a navigation menu that allows them to show the first two levels as horizontal main navigation menu and the other levels as optional vertical submenu. You can now accomplish that with the combination of the stop level set to 2 and ', 0, 0, 0, 0, NULL, '', '', '', '', 0, '', '', NULL, '', NULL, NULL, '', 0, 0, 0, 0, 0, '', '', '', '', '', 'sourceText', NULL, '', 0, 0, '', '', '', '', 0, NULL, 0, 4, 0, 0, '', 0, '', '', NULL, '', '', 0x00000000000000000000000000000000, '', NULL, '0', '0', '', '', 0, '', '', NULL, NULL, 0, 300, 0, 0, NULL, 0, 0, 0, 0, 0, 0, NULL, 'a:2:{i:0;s:0:\"\";i:1;s:16:\"sibling-space--2\";}', 0, '', '', '', 0, 0, 0, 0, 0, '', NULL, 0, '', NULL, 'en', NULL, '', '', '', ''),
(156, 'text', 81, 'tl_article', 896, 1682527757, 'a:2:{s:4:\"unit\";s:2:\"h2\";s:5:\"value\";s:13:\"Start level 1\";}', '<p>The \"navigation submenu items\" module basically displays the navigation menu from the second level, using the current main menu item as the starting point. Now you can accomplish the same structure with the navigation menu by simply setting the start level to 1. Here is how the navigation menu looks like on the page Music -&gt; Genres -&gt; Pop.</p>\n<ul>\n<li>Genres\n<ul>\n<li>Pop</li>\n<li>Rock</li>\n</ul>\n</li>\n<li>Artists\n<ul>\n<li>Mrs. X</li>\n<li>Mrs. Y</li>\n</ul>\n</li>\n</ul>', 0, 0, 0, 0, NULL, '', '', '', '', 0, '', '', NULL, '', NULL, NULL, '', 0, 0, 0, 0, 0, '', '', '', '', '', 'sourceText', NULL, '', 0, 0, '', '', '', '', 0, NULL, 0, 4, 0, 0, '', 0, '', '', NULL, '', '', 0x00000000000000000000000000000000, '', NULL, '0', '0', '', '', 0, '', '', NULL, NULL, 0, 300, 0, 0, NULL, 0, 0, 0, 0, 0, 0, NULL, 'a:2:{i:0;s:0:\"\";i:1;s:16:\"sibling-space--2\";}', 0, '', '', '', 0, 0, 0, 0, 0, '', NULL, 0, '', NULL, 'en', NULL, '', '', '', ''),
(157, 'text', 81, 'tl_article', 1024, 1389542158, 'a:2:{s:4:\"unit\";s:2:\"h2\";s:5:\"value\";s:13:\"Start level 2\";}', '<p>If your main navigation menu includes the first two levels, but you also want your submenu to start with an offset of two levels you have to set the start level to an equivalent 2. Here is how the navigation menu looks like on the <em>Pop</em> page.</p>\n<ul>\n<li>Pop</li>\n<li>Rock</li>\n</ul>', 0, 0, 0, 0, NULL, '', '', '', '', 0, '', '', NULL, '', NULL, NULL, '', 0, 0, 0, 0, 0, '', '', '', '', '', 'sourceText', NULL, '', 0, 0, '', '', '', '', 0, NULL, 0, 4, 0, 0, '', 0, '', '', NULL, '', '', 0x00000000000000000000000000000000, '', NULL, '0', '0', '', '', 0, '', '', NULL, NULL, 0, 300, 0, 0, NULL, 0, 0, 0, 0, 0, 0, NULL, 'a:2:{i:0;s:0:\"\";i:1;s:0:\"\";}', 0, '', '', '', 0, 0, 0, 0, 0, '', NULL, 0, '', NULL, 'en', NULL, '', '', '', ''),
