(160, 'text', 38, 'tl_article', 68, 1707849333, 'a:2:{s:4:\"unit\";s:2:\"h1\";s:5:\"value\";s:14:\"A powerful CMS\";}', '<p>Manage your contents the easy/simple way. Contao enables you to create awesome interactive elements like the slider you see here with ease. This slider is based on swipe.js and comes out of the box with/including support for mobile devices.</p>', 1, 0, 0, 1, 0xa5324641b1e811eda857525400fc3de0, 'Big Slider C', 'Big Slider C', 'a:3:{i:0;s:0:\"\";i:1;s:0:\"\";i:2;s:1:\"3\";}', NULL, 0, '', 'right', NULL, '', NULL, NULL, '', 0, 0, 0, 0, 0, 'ascending', '', '', '', '', 'sourceText', NULL, '', 0, 0, '', '', '', '', 0, NULL, 0, 4, 0, 0, '', 0, '', 'content_element/text/slider', NULL, '', '', 0x00000000000000000000000000000000, '', NULL, '0', '0', '', '', 0, '', '', NULL, NULL, 0, 300, 0, 0, NULL, 0, 0, 0, 0, 0, 0, NULL, 'a:2:{i:0;s:0:\"\";i:1;s:0:\"\";}', 0, '', '', 'ascending', 0, 0, 0, 0, 0, 'com_default', NULL, 0, '', NULL, 'en', NULL, '', '', '', ''),
(163, 'text', 63, 'tl_article', 128, 1680539541, 'a:2:{s:4:\"unit\";s:2:\"h1\";s:5:\"value\";s:16:\"Content elements\";}', '<p class=\"text--lg\">Content elements are an easy and intuitive way to create content. Instead of just using a Rich Text Editor, Contao provides a separate element for each type of content like texts, lists, tables, hyperlinks, images or downloads. Here is an overview of the Contao core content elements:</p>', 0, 0, 0, 0, NULL, '', '', '', '', 0, '', '', NULL, '', NULL, NULL, '', 0, 0, 0, 0, 0, 'ascending', '', '', '', '', 'sourceText', NULL, '', 0, 0, '', '', '', '', 0, NULL, 0, 4, 0, 0, '', 0, '', '', NULL, '', '', 0x00000000000000000000000000000000, '', NULL, '0', '0', '', '', 0, '', '', NULL, NULL, 0, 300, 0, 0, NULL, 0, 0, 0, 0, 0, 0, NULL, 'a:2:{i:0;s:0:\"\";i:1;s:0:\"\";}', 0, '', '', 'ascending', 0, 0, 0, 0, 0, 'com_default', NULL, 0, '', NULL, 'en', NULL, '', '', '', '');
