(174, 'text', 66, 'tl_article', 384, 1728050837, 'a:2:{s:4:\"unit\";s:2:\"h2\";s:5:\"value\";s:4:\"Text\";}', '<p>The text element provides a rich text editor in the back-end allowing you to format the text output in the same way as popular office software. You can set words or phrases in bold or italic or add underlining and integrate (hyper) links to other pages of the same website, links to files or file downloads or external URLs to name just a few features of the utilized tinyMCE editor.</p>\n<p>The element also allows to add a single image which can be positioned relatively to the text. The image can be placed above or below the text or placed floating left or right of the text. You are able to choose from several options to modify the picture, e.g. resizing or even cropping it and to add a link to a contao page, to an external URI or to a full resolution version of the image. You can define wether the linked page will be opened in a new window or tab of your browser. The full resolution version of the image will be opened in an overlay on the same page if defined that way in the page layout.</p>', 1, 0, 0, 1, 0xc67514dfd9c811e38217000c29e44aea, 'Adding an image to a text element', 'Adding an image to a text element', 'a:3:{i:0;s:0:\"\";i:1;s:0:\"\";i:2;s:1:\"1\";}', NULL, 0, 'Adding an image to a text element', 'below', NULL, '', NULL, NULL, '', 0, 0, 0, 0, 0, 'ascending', '', '', '', '', 'sourceText', NULL, '', 0, 0, '', '', '', '', 0, NULL, 0, 4, 0, 0, '', 0, '', '', NULL, '', '', 0x00000000000000000000000000000000, '', NULL, '0', '0', '', '', 0, '', '', NULL, NULL, 0, 300, 0, 0, NULL, 0, 0, 0, 0, 0, 0, NULL, 'a:2:{i:0;s:0:\"\";i:1;s:12:\"divider--top\";}', 0, '', '', 'ascending', 0, 0, 0, 0, 0, 'com_default', NULL, 0, '', NULL, 'en', NULL, '', '', '', ''),
(176, 'text', 66, 'tl_article', 512, 1728049155, 'a:2:{s:4:\"unit\";s:2:\"h2\";s:5:\"value\";s:4:\"HTML\";}', '<p>The HTML element can be used to enter pure HTML code.</p>\n<p>The allowed tags have to be defined in the contao settings in the security section. Most of the HTML tags are allowed by default. Some tags with security relevance such as &#39;script&#39; have to be added manually if needed.</p>', 0, 0, 0, 0, NULL, '', '', '', '', 0, '', '', NULL, '', NULL, NULL, '', 0, 0, 0, 0, 0, 'ascending', '', '', '', '', 'sourceText', NULL, '', 0, 0, '', '', '', '', 0, NULL, 0, 4, 0, 0, '', 0, '', '', NULL, '', '', 0x00000000000000000000000000000000, '', NULL, '0', '0', '', '', 0, '', '', NULL, NULL, 0, 300, 0, 0, NULL, 0, 0, 0, 0, 0, 0, NULL, 'a:2:{i:0;s:4:\"html\";i:1;s:29:\"divider--top sibling-space--2\";}', 1, '', '', 'ascending', 0, 0, 0, 0, 0, 'com_default', NULL, 0, '', NULL, 'en', NULL, '', '', '', ''),
(177, 'text', 66, 'tl_article', 640, 1682505204, 'a:2:{s:4:\"unit\";s:2:\"h2\";s:5:\"value\";s:4:\"List\";}', '<p>To add ordered or unordered lists as a single element - not within the text element - contao provides the list element. With a special back-end widget you can add each list entry via a single input field, sort the entries, insert new entries or copy them.</p>', 0, 0, 0, 1, 0x8239b340a4c311e38e29000c29e44aea, 'The list widget', 'The list widget', 'a:3:{i:0;s:3:\"250\";i:1;s:0:\"\";i:2;s:12:\"proportional\";}', '', 1, 'The list widget', 'right', NULL, '', NULL, NULL, '', 0, 0, 0, 0, 0, 'ascending', '', '', '', '', 'sourceText', NULL, '', 0, 0, '', '', '', '', 0, NULL, 0, 4, 0, 0, '', 0, '', '', NULL, '', '', 0x00000000000000000000000000000000, '', NULL, '0', '0', '', '', 0, '', '', NULL, NULL, 0, 300, 0, 0, NULL, 0, 0, 0, 0, 0, 0, NULL, 'a:2:{i:0;s:4:\"list\";i:1;s:29:\"divider--top sibling-space--2\";}', 0, '', '', 'ascending', 0, 0, 0, 0, 0, 'com_default', NULL, 0, '', NULL, 'en', NULL, '', '', '', ''),
(179, 'text', 66, 'tl_article', 768, 1682526837, 'a:2:{s:4:\"unit\";s:2:\"h2\";s:5:\"value\";s:5:\"Table\";}', '<p>To create a table you can use the table element. Contao offers a special back-end widget, similar to the one utilized for lists, to add columns and rows, define a head- and footer-row and add a summary for the table content. In the front-end output, special classes can be chosen and added to the table, rows and cells. Just check the HTML code of the page <a href=\"{{link_url::48|urlattr}}\" title=\"{{link_title::48|attr}}\">content elements</a>, to explore the possible classes.</p>\n<p>In addition, you can add a sorting option for the frontend to make the table sortable by all columns.</p>', 0, 0, 0, 1, 0x8239f1e8a4c311e38e29000c29e44aea, 'The table widget', 'The table widget', 'a:3:{i:0;s:3:\"250\";i:1;s:0:\"\";i:2;s:12:\"proportional\";}', '', 1, 'The table widget', 'right', NULL, '', NULL, NULL, '', 0, 0, 0, 0, 0, 'ascending', '', '', '', '', 'sourceText', NULL, '', 0, 0, '', '', '', '', 0, NULL, 0, 4, 0, 0, '', 0, '', '', NULL, '', '', 0x00000000000000000000000000000000, '', NULL, '0', '0', '', '', 0, '', '', NULL, NULL, 0, 300, 0, 0, NULL, 0, 0, 0, 0, 0, 0, NULL, 'a:2:{i:0;s:5:\"table\";i:1;s:29:\"divider--top sibling-space--2\";}', 0, '', '', 'ascending', 0, 0, 0, 0, 0, 'com_default', NULL, 0, '', NULL, 'en', NULL, '', '', '', ''),
(180, 'text', 66, 'tl_article', 896, 1728049170, 'a:2:{s:4:\"unit\";s:2:\"h2\";s:5:\"value\";s:4:\"Code\";}', '<p>To provide a snippet of programming code like i.e. Php or JavaScript, you use the code element. The code will not be executed in the front-end of the page.</p>', 0, 0, 0, 0, NULL, '', '', '', '', 0, '', '', NULL, '', NULL, NULL, '', 0, 0, 0, 0, 0, 'ascending', '', '', '', '', 'sourceText', NULL, '', 0, 0, '', '', '', '', 0, NULL, 0, 4, 0, 0, '', 0, '', '', NULL, '', '', 0x00000000000000000000000000000000, '', NULL, '0', '0', '', '', 0, '', '', NULL, NULL, 0, 300, 0, 0, NULL, 0, 0, 0, 0, 0, 0, NULL, 'a:2:{i:0;s:4:\"code\";i:1;s:29:\"divider--top sibling-space--2\";}', 1, '', '', 'ascending', 0, 0, 0, 0, 0, 'com_default', NULL, 0, '', NULL, 'en', NULL, '', '', '', ''),
