(183, 'text', 67, 'tl_article', 256, 1682526986, 'a:2:{s:4:\"unit\";s:2:\"h1\";s:5:\"value\";s:0:\"\";}', '<p class=\"text--lg\">The accordion element allows you to place content inside a closed panel. By clicking the headline of the panel, it will expand and close any other expanded panels.</p>\n<p>You can add an unlimited number of accordion elements on a page.</p>\n<p>Contao offers two types of accordion elements:</p>', 0, 0, 0, 0, NULL, '', '', '', '', 0, '', '', NULL, '', NULL, NULL, '', 0, 0, 0, 0, 0, 'ascending', '', '', '', '', 'sourceText', NULL, '', 0, 0, '', '', '', '', 0, NULL, 0, 4, 0, 0, '', 0, '', '', NULL, '', '', 0x00000000000000000000000000000000, '', NULL, '0', '0', '', '', 0, '', '', NULL, NULL, 0, 300, 0, 0, NULL, 0, 0, 0, 0, 0, 0, NULL, 'a:2:{i:0;s:0:\"\";i:1;s:16:\"sibling-space--2\";}', 0, '', '', 'ascending', 0, 0, 0, 0, 0, 'com_default', NULL, 0, '', NULL, 'en', NULL, '', '', '', ''),
(185, 'headline', 68, 'tl_article', 128, 1367243683, 'a:2:{s:4:\"unit\";s:2:\"h1\";s:5:\"value\";s:14:\"Content slider\";}', NULL, 0, 0, 0, 0, NULL, '', '', '', '', 0, '', '', NULL, '', NULL, NULL, '', 0, 0, 0, 0, 0, 'ascending', '', '', '', '', 'sourceText', NULL, '', 0, 0, '', '', '', '', 0, NULL, 0, 4, 0, 0, '', 0, '', '', NULL, '', '', 0x00000000000000000000000000000000, '', NULL, '0', '0', '', '', 0, '', '', NULL, NULL, 0, 300, 0, 0, NULL, 0, 0, 0, 0, 0, 0, NULL, 'a:2:{i:0;s:0:\"\";i:1;s:0:\"\";}', 0, '', '', 'ascending', 0, 0, 0, 0, 0, 'com_default', NULL, 0, '', NULL, 'en', NULL, '', '', '', ''),
(186, 'text', 68, 'tl_article', 256, 1680539693, 'a:2:{s:4:\"unit\";s:2:\"h1\";s:5:\"value\";s:0:\"\";}', '<p class=\"text--lg\">The content slider does exactly, what its name says. Similar to the <a title=\"{{link_title::52|attr}}\" href=\"{{link_url::52|urlattr}}\">accordion</a> the slider needs a wrapper start and stop. All elements placed between these wrapper elements represent the slided content.</p>\n<p>The wrapper start element offers you some parameters to modify the slider:</p>\n<ol>\n<li>Sliding interval: the time in milliseconds a slide is displayed until it is replaced by the next<br>one (1000 &#61; 1s)</li>\n<li>Transition speed: the speed of the transition from slide to slide in milliseconds (1000 &#61; 1s)</li>\n<li>Slide offset: setting a specific slide as the starting point, the counting starts at 0</li>\n<li>Continous:&nbsp;Make the slider start all over when reaching the end</li>\n</ol>\n<p>You can see the slider in action on the&nbsp;<a title=\"{{link_title::2|attr}}\" href=\"{{link_url::2|urlattr}}\">homepage</a>.</p>\n<p>To use it, jQuery or Mootools need to be enabled in the page layout and the corresponding j- or moo-template has to be added as well.</p>', 0, 0, 0, 0, NULL, '', '', '', '', 0, '', '', NULL, '', NULL, NULL, '', 0, 0, 0, 0, 0, 'ascending', '', '', '', '', 'sourceText', NULL, '', 0, 0, '', '', '', '', 0, NULL, 0, 4, 0, 0, '', 0, '', '', NULL, '', '', 0x00000000000000000000000000000000, '', NULL, '0', '0', '', '', 0, '', '', NULL, NULL, 0, 300, 0, 0, NULL, 0, 0, 0, 0, 0, 0, NULL, 'a:2:{i:0;s:0:\"\";i:1;s:0:\"\";}', 0, '', '', 'ascending', 0, 0, 0, 0, 0, 'com_default', NULL, 0, '', NULL, 'en', NULL, '', '', '', ''),
