(191, 'text', 75, 'tl_article', 128, 1680539994, 'a:2:{s:4:\"unit\";s:2:\"h1\";s:5:\"value\";s:3:\"FAQ\";}', '<p class=\"text--lg\">Contaos FAQ module offers a structured method to create customized &#34;Question &amp; Answer&#34; sections on your website.</p>', 0, 0, 0, 0, NULL, '', '', '', '', 0, '', '', '', '', '', '', '', 0, 0, 0, 0, 0, '', '', '', '', '', 'sourceText', '', '', 0, 0, '', '', '', '', 0, '', 0, 4, 0, 0, '', 0, '', '', NULL, '', '', 0x00000000000000000000000000000000, '', NULL, '0', '0', '', '', 0, '', '', NULL, NULL, 0, 300, 0, 0, NULL, 0, 0, 0, 0, 0, 0, NULL, 'a:2:{i:0;s:0:\"\";i:1;s:0:\"\";}', 0, '', '', '', 0, 0, 0, 0, 0, '', NULL, 0, '', NULL, 'en', NULL, '', '', '', ''),
