(193, 'text', 77, 'tl_article', 128, 1727978648, 'a:2:{s:4:\"unit\";s:2:\"h2\";s:5:\"value\";s:14:\"Form generator\";}', '<p>Forms are a very important tool to help you to create user feedback from the visitors of your website. Contao features an easy way to build and edit individual forms with its Form generator. All the common form fields known from HTML can be used and there are several ways to apply different options to each field. You can make them mandatory, define allowed input values or add CSS classes to specific fields.</p>\n<p>The Form generator also allows to &#34;Send form data via e-mail&#34; or &#34;Store data&#34; in your database. For the submission methods you can choose between POST and GET. You will see there is a lot of fun in the module out of the box.</p>', 0, 0, 0, 0, NULL, '', '', '', '', 0, '', '', NULL, '', NULL, NULL, '', 0, 0, 0, 0, 0, 'ascending', '', '', '', '', 'sourceText', NULL, '', 0, 0, '', '', '', '', 0, NULL, 0, 4, 0, 0, '', 0, '', '', NULL, '', '', 0x00000000000000000000000000000000, '', NULL, '0', '0', '', '', 0, '', '', NULL, NULL, 0, 300, 0, 0, NULL, 0, 0, 0, 0, 0, 0, NULL, 'a:2:{i:0;s:0:\"\";i:1;s:16:\"sibling-space--2\";}', 0, '', '', 'ascending', 0, 0, 0, 0, 0, 'com_default', NULL, 0, '', NULL, 'en', NULL, '', '', '', ''),
