(212, 'accordionSingle', 67, 'tl_article', 320, 1389539668, '', '<p>This panel is build with only one element. You enter the section headline that is used as the expanding link. The content of the section is entered in a richt text field similar to text field in text elements.</p>\n<p>You even have the possibility to add an image to the content.</p>', 0, 0, 0, 0, NULL, '', '', '', '', 0, '', '', NULL, '', NULL, NULL, '', 0, 0, 0, 0, 0, 'ascending', 'Accordion single element', '', 'a:2:{i:0;s:0:\"\";i:1;s:0:\"\";}', '', 'sourceText', NULL, '', 0, 0, '', '', '', '', 0, NULL, 0, 4, 0, 0, '', 0, '', '', NULL, '', '', 0x00000000000000000000000000000000, '', NULL, '0', '0', '', '', 0, '', '', NULL, NULL, 0, 300, 0, 0, NULL, 0, 0, 0, 0, 0, 0, NULL, 'a:2:{i:0;s:16:\"single_accordion\";i:1;s:0:\"\";}', 0, '', '', 'ascending', 0, 0, 0, 0, 0, 'com_default', NULL, 0, '', NULL, 'en', NULL, '', '', '', ''),
