(216, 'accordionSingle', 67, 'tl_article', 444, 1389539732, '', '<p>To use this type of accordion element on your page, you have to enable either jQuery or Mootools and add the j_accordion or moo_accordion template to your page layout.</p>', 0, 0, 0, 0, NULL, '', '', '', '', 0, '', '', NULL, '', NULL, NULL, '', 0, 0, 0, 0, 0, 'ascending', 'Javascript Accordion', '', 'a:2:{i:0;s:0:\"\";i:1;s:0:\"\";}', '', 'sourceText', NULL, '', 0, 0, '', '', '', '', 0, NULL, 0, 4, 0, 0, '', 0, '', '', NULL, '', '', 0x00000000000000000000000000000000, '', NULL, '0', '0', '', '', 0, '', '', NULL, NULL, 0, 300, 0, 0, NULL, 0, 0, 0, 0, 0, 0, NULL, 'a:2:{i:0;s:0:\"\";i:1;s:0:\"\";}', 0, '', '', 'ascending', 0, 0, 0, 0, 0, 'com_default', NULL, 0, '', NULL, 'en', NULL, '', '', '', ''),
(217, 'text', 69, 'tl_article', 256, 1680539745, 'a:2:{s:4:\"unit\";s:2:\"h1\";s:5:\"value\";s:0:\"\";}', '<p class=\"text--lg\">Links are an essential part of each website. You can place links within any element with a rich text editor as a hyperlink and you can add a link which always leads to the top if the page, the toplink.</p>', 0, 0, 0, 0, NULL, '', '', '', '', 0, '', '', NULL, '', NULL, NULL, '', 0, 0, 0, 0, 0, 'ascending', '', '', '', '', 'sourceText', NULL, '', 0, 0, '', '', '', '', 0, NULL, 0, 4, 0, 0, '', 0, '', '', NULL, '', '', 0x00000000000000000000000000000000, '', NULL, '0', '0', '', '', 0, '', '', NULL, NULL, 0, 300, 0, 0, NULL, 0, 0, 0, 0, 0, 0, NULL, 'a:2:{i:0;s:0:\"\";i:1;s:0:\"\";}', 0, '', '', 'ascending', 0, 0, 0, 0, 0, 'com_default', NULL, 0, '', NULL, 'en', NULL, '', '', '', ''),
(218, 'text', 69, 'tl_article', 384, 1682527134, 'a:2:{s:4:\"unit\";s:2:\"h2\";s:5:\"value\";s:9:\"Hyperlink\";}', '<p>You can add links within the rich text editor in the text element. To define special links, with a specific layout or with an image acting as the link, you use the hyperlink element.</p>\n<p>The following fields should always be addressed:</p>\n<ol>\n<li><strong>Link target:</strong> the destination of the link, it can be an external URL such as https://contao.org or an internal link you can chose from the Contao site structure</li>\n<li><strong>Open in new window:</strong> force the link to be opend in a new browser window or tab</li>\n<li><strong>Link text:</strong> the word or phrase that will be displayed and act as the link</li>\n<li><strong>Embed the link:</strong> a phrase to embed the link in the page by using &#34;%p&#34; as the wildcard</li>\n<li><strong>Link title:</strong> the title attribute of the a-tag</li>\n<li><strong>Lightbox:</strong> forces the browser to open the link inside a lightbox. For this field to be available Mootools or jQuery has to be enabled in the page layout and a corresponding j- or moo-template has to be added</li>\n</ol>\n<p>You can even use an image link by activating the checkbox &#34;create an image link&#34;. Choose an image in the file manager, enter alternate text to be displayed when the image can not be displayed, enter an image title to be displayed with the image, set the title dimensions of the image and an optional caption.</p>', 0, 0, 0, 0, NULL, '', '', '', '', 0, '', '', NULL, '', NULL, NULL, '', 0, 0, 0, 0, 0, 'ascending', '', '', '', '', 'sourceText', NULL, '', 0, 0, '', '', '', '', 1, NULL, 0, 4, 0, 0, '', 0, '', '', NULL, '', '', 0x00000000000000000000000000000000, '', NULL, '0', '0', '', '', 0, '', '', NULL, NULL, 0, 300, 0, 0, NULL, 0, 0, 0, 0, 0, 0, NULL, 'a:2:{i:0;s:9:\"hyperlink\";i:1;s:16:\"sibling-space--2\";}', 0, '', '', 'ascending', 0, 0, 0, 0, 0, 'com_default', NULL, 0, '', NULL, 'en', NULL, '', '', '', ''),
(219, 'text', 69, 'tl_article', 512, 1682527116, 'a:2:{s:4:\"unit\";s:2:\"h2\";s:5:\"value\";s:8:\"Top link\";}', '<p>The toplink element adds a link element leading to the top of the current page.</p>\n<p>You just enter the link text to be displayed for this element.</p>\n<p>You can see the element in action on the <a href=\"{{link_url::48|urlattr}}\" title=\"{{link_title::48|attr}}\">content element overview page</a>.</p>', 0, 0, 0, 0, NULL, '', '', '', '', 0, '', '', NULL, '', NULL, NULL, '', 0, 0, 0, 0, 0, 'ascending', '', '', '', '', 'sourceText', NULL, '', 0, 0, '', '', '', '', 0, NULL, 0, 4, 0, 0, '', 0, '', '', NULL, '', '', 0x00000000000000000000000000000000, '', NULL, '0', '0', '', '', 0, '', '', NULL, NULL, 0, 300, 0, 0, NULL, 0, 0, 0, 0, 0, 0, NULL, 'a:2:{i:0;s:7:\"toplink\";i:1;s:29:\"divider--top sibling-space--2\";}', 0, '', '', 'ascending', 0, 0, 0, 0, 0, 'com_default', NULL, 0, '', NULL, 'en', NULL, '', '', '', ''),
