(227, 'text', 64, 'tl_article', 128, 1680539839, 'a:2:{s:4:\"unit\";s:2:\"h1\";s:5:\"value\";s:7:\"Modules\";}', '<p class=\"text--lg\">In this section we would like to introduce the different modules delivered with every Contao installation. Modules in Contao help you to achieve certain functions and possibilities for your users to interact with your website. You can either create different ways of displaying page navigations, create a search module, import RSS-feeds or integrate a user registration.</p>\n<p>Modules are defined in the front end modules section of the back end under Layout &gt; Themes</p>', 0, 0, 0, 0, NULL, '', '', '', '', 0, '', '', NULL, '', NULL, NULL, '', 0, 0, 0, 0, 0, 'ascending', '', '', '', '', 'sourceText', NULL, '', 0, 0, '', '', '', '', 0, NULL, 0, 4, 0, 0, '', 0, '', '', NULL, '', '', 0x00000000000000000000000000000000, '', NULL, '0', '0', '', '', 0, '', '', NULL, NULL, 0, 300, 0, 0, NULL, 0, 0, 0, 0, 0, 0, NULL, 'a:2:{i:0;s:0:\"\";i:1;s:0:\"\";}', 0, '', '', 'ascending', 0, 0, 0, 0, 0, 'com_default', NULL, 0, '', NULL, 'en', NULL, '', '', '', ''),
