(242, 'text', 73, 'tl_article', 160, 1680539908, 'a:2:{s:4:\"unit\";s:2:\"h1\";s:5:\"value\";s:0:\"\";}', '<p class=\"text--lg\">Contao handles news via news archives in the back end. Among a lot of functions for the handling of your news the most important ones are the title, a teaser text, a full text, images or the publishing date.</p>\n<p>With only four modules you can create different outputs for your news articles. The Newslist adds a simple list of news items to the page. Different templates also enabke you to style the output. If you would like to direct visitors of your page to the corresponding full news article of a given news item you need to integrate the Newsreader. News can also be sorted using the modules News Archive. The News Archive menu makes the news archive more accessible by generating a navigation menu to enable a visitor to browse the news archive.</p>', 0, 0, 0, 0, NULL, '', '', '', '', 0, '', '', NULL, '', NULL, NULL, '', 0, 0, 0, 0, 0, 'ascending', '', '', '', '', 'sourceText', NULL, '', 0, 0, '', '', '', '', 0, NULL, 0, 4, 0, 0, '', 0, '', '', NULL, '', '', 0x00000000000000000000000000000000, '', NULL, '0', '0', '', '', 0, '', '', NULL, NULL, 0, 300, 0, 0, NULL, 0, 0, 0, 0, 0, 0, NULL, 'a:2:{i:0;s:0:\"\";i:1;s:0:\"\";}', 0, '', '', 'ascending', 0, 0, 0, 0, 0, 'com_default', NULL, 0, '', NULL, 'en', NULL, '', '', '', ''),
