(246, 'text', 79, 'tl_article', 144, 1680539893, 'a:2:{s:4:\"unit\";s:2:\"h1\";s:5:\"value\";s:0:\"\";}', '<p class=\"text--lg\">Contao comes with a very smart user handling. User is a very general term and refers in Contao to users who have access to the back end. Front end users are called members in Contao.</p>', 0, 0, 0, 0, NULL, '', '', '', '', 0, '', '', NULL, '', NULL, NULL, '', 0, 0, 0, 0, 0, 'ascending', '', '', '', '', 'sourceText', NULL, '', 0, 0, '', '', '', '', 0, NULL, 0, 4, 0, 0, '', 0, '', '', NULL, '', '', 0x00000000000000000000000000000000, '', NULL, '0', '0', '', '', 0, '', '', NULL, NULL, 0, 300, 0, 0, NULL, 0, 0, 0, 0, 0, 0, NULL, 'a:2:{i:0;s:0:\"\";i:1;s:0:\"\";}', 0, '', '', 'ascending', 0, 0, 0, 0, 0, 'com_default', NULL, 0, '', NULL, 'en', NULL, '', '', '', ''),
