(255, 'text', 80, 'tl_article', 1024, 1682528363, 'a:2:{s:4:\"unit\";s:2:\"h2\";s:5:\"value\";s:12:\"Article list\";}', '<p>The module &#34;article list&#34; shows&nbsp;all articles of an selected page (or all if empty) from a specified column. In the example above you see all articles&nbsp;of the home page in the main column.</p>', 0, 0, 0, 0, NULL, '', '', '', '', 0, '', '', NULL, '', NULL, NULL, '', 0, 0, 0, 0, 0, 'ascending', '', '', '', '', 'sourceText', NULL, '', 0, 0, '', '', '', '', 0, NULL, 0, 4, 0, 0, '', 0, '', '', NULL, '', '', 0x00000000000000000000000000000000, '', NULL, '0', '0', '', '', 0, '', '', NULL, NULL, 0, 300, 0, 0, NULL, 0, 0, 0, 0, 0, 0, NULL, 'a:2:{i:0;s:0:\"\";i:1;s:16:\"sibling-space--2\";}', 0, '', '', 'ascending', 0, 0, 0, 0, 0, 'com_default', NULL, 0, '', NULL, 'en', NULL, '', '', '', ''),
(256, 'text', 80, 'tl_article', 1152, 1682528591, 'a:2:{s:4:\"unit\";s:2:\"h2\";s:5:\"value\";s:12:\"Random image\";}', '<p>The module &#34;random image&#34; displays randomized images.&nbsp;</p>\n<p>Reload the Page&nbsp;to see another random image</p>', 0, 0, 0, 0, NULL, '', '', '', '', 0, '', '', NULL, '', NULL, NULL, '', 0, 0, 0, 0, 0, 'ascending', '', '', '', '', 'sourceText', NULL, '', 0, 0, '', '', '', '', 0, NULL, 0, 4, 0, 0, '', 0, '', '', NULL, '', '', 0x00000000000000000000000000000000, '', NULL, '0', '0', '', '', 0, '', '', NULL, NULL, 0, 300, 0, 0, NULL, 0, 0, 0, 0, 0, 0, NULL, 'a:2:{i:0;s:12:\"random-image\";i:1;s:29:\"divider--top sibling-space--2\";}', 0, '', '', 'ascending', 0, 0, 0, 0, 0, 'com_default', NULL, 0, '', NULL, 'en', NULL, '', '', '', ''),
(257, 'text', 80, 'tl_article', 1280, 1682528582, 'a:2:{s:4:\"unit\";s:2:\"h2\";s:5:\"value\";s:11:\"Custom HTML\";}', '<p>The Custom HTML module is plain and simple. You get a text area input field that renders all your HTML content as a module. You can use it for all kinds HTML tags. Custom HTML</p>', 0, 0, 0, 0, NULL, '', '', '', '', 0, '', '', NULL, '', NULL, NULL, '', 0, 0, 0, 0, 0, 'ascending', '', '', '', '', 'sourceText', NULL, '', 0, 0, '', '', '', '', 0, NULL, 0, 4, 0, 0, '', 0, '', '', NULL, '', '', 0x00000000000000000000000000000000, '', NULL, '0', '0', '', '', 0, '', '', NULL, NULL, 0, 300, 0, 0, NULL, 0, 0, 0, 0, 0, 0, NULL, 'a:2:{i:0;s:0:\"\";i:1;s:29:\"divider--top sibling-space--2\";}', 0, '', '', 'ascending', 0, 0, 0, 0, 0, 'com_default', NULL, 0, '', NULL, 'en', NULL, '', '', '', ''),
(258, 'text', 80, 'tl_article', 1408, 1682528551, 'a:2:{s:4:\"unit\";s:2:\"h2\";s:5:\"value\";s:10:\"RSS reader\";}', '<p>The RSS reader module offers the possibility to integrate XML-feeds into your website. You can add multiple feeds, define the number of news items to be displayed, set the items per page to activate a pagination or tell the module how many news items you would like to skip.</p>', 0, 0, 0, 0, NULL, '', '', '', '', 0, '', '', NULL, '', NULL, NULL, '', 0, 0, 0, 0, 0, 'ascending', '', '', '', '', 'sourceText', NULL, '', 0, 0, '', '', '', '', 0, NULL, 0, 4, 0, 0, '', 0, '', '', NULL, '', '', 0x00000000000000000000000000000000, '', NULL, '0', '0', '', '', 0, '', '', NULL, NULL, 0, 300, 0, 0, NULL, 0, 0, 0, 0, 0, 0, NULL, 'a:2:{i:0;s:0:\"\";i:1;s:29:\"divider--top sibling-space--2\";}', 0, '', '', 'ascending', 0, 0, 0, 0, 0, 'com_default', NULL, 0, '', NULL, 'en', NULL, '', '', '', ''),
