(315, 'text', 38, 'tl_article', 82, 1707849332, 'a:2:{s:4:\"unit\";s:2:\"h1\";s:5:\"value\";s:17:\"Highly Extendible\";}', '<p>Contao ist highly extendible with a lot of extensions build by the great Contao community. Go and check out the <a rel=\"noopener\" href=\"https://extensions.contao.org\" target=\"_blank\">Contao Extensions</a> to see more than 1500 extensions.</p>', 1, 0, 0, 1, 0x1e633f57044b11ee8d3d525400fc3de0, '', 'Big Slider C', 'a:3:{i:0;s:0:\"\";i:1;s:0:\"\";i:2;s:1:\"3\";}', NULL, 0, '', 'right', NULL, '', NULL, NULL, '', 0, 0, 0, 0, 0, 'ascending', '', '', '', '', 'sourceText', NULL, '', 0, 0, '', '', '', '', 0, NULL, 0, 4, 0, 0, '', 0, '', 'content_element/text/slider', NULL, '', '', 0x00000000000000000000000000000000, '', NULL, '0', '0', '', '', 0, '', '', NULL, NULL, 0, 300, 0, 0, NULL, 0, 0, 0, 0, 0, 0, NULL, 'a:2:{i:0;s:0:\"\";i:1;s:0:\"\";}', 0, '', '', 'ascending', 0, 0, 0, 0, 0, 'com_default', NULL, 0, '', NULL, 'en', NULL, '', '', '', ''),
