(342, 'text', 50, 'tl_article', 256, 1697113746, 'a:2:{s:4:\"unit\";s:2:\"h6\";s:5:\"value\";s:15:\"Open Source CMS\";}', '<p>Contao is open source soft&shy;ware li&shy;censed un&shy;der the LGPL-3.0.  The li&shy;cense per&shy;mits the free use of the software even for com&shy;mer&shy;cial pro&shy;jects.</p>\n<p>You can track the de&shy;vel&shy;op&shy;ment of Con&shy;tao on <a rel=\"noopener\" href=\"https://github.com/contao/contao\" target=\"_blank\" title=\"Contao on GitHub\">GitHub</a> and you are  wel&shy;come to join in if you want. If you think you have found a se&shy;cu&shy;ri&shy;ty prob&shy;lem in Con&shy;tao, please re&shy;port it re&shy;spon&shy;si&shy;bly ac&shy;cord&shy;ing to our <a rel=\"noopener\" href=\"https://github.com/contao/contao/security/policy\" target=\"_blank\" title=\"security policy\">security policy</a>.</p>', 0, 0, 0, 0, NULL, '', '', '', NULL, 0, '', 'above', NULL, '', NULL, NULL, '', 0, 0, 0, 0, 0, 'ascending', '', '', '', '', 'sourceText', NULL, NULL, 0, 0, '', '', '', '', 0, NULL, 0, 4, 0, 0, '', 0, '', '', NULL, '', '', NULL, '', NULL, '0', '0', '', '', 0, '', '', NULL, NULL, 0, 300, 0, 0, NULL, 0, 0, 0, 0, 0, 0, NULL, 'a:2:{i:0;s:0:\"\";i:1;s:0:\"\";}', 0, '', '', 'ascending', 0, 0, 0, 0, 0, '', NULL, 0, '', NULL, 'en', NULL, '', '', '', ''),
