(393, 'text', 104, 'tl_article', 128, 1730472813, 'a:2:{s:4:\"unit\";s:2:\"h2\";s:5:\"value\";s:14:\"nature gallery\";}', '<p>Welcome to the <strong>Nature Gallery</strong>, where the timeless beauty of forests and green landscapes comes alive. This gallery offers a journey through the lush, green heart of nature—where towering trees, sun-dappled glades, and tranquil meadows awaken the senses and reconnect visitors to the earth’s natural wonders.</p>', 1, 0, 0, 0, 0x01572927983711ef92c7a8a1598b245a, '', '', 'a:3:{i:0;s:0:\"\";i:1;s:0:\"\";i:2;s:1:\"5\";}', NULL, 0, '', 'left', NULL, '', NULL, NULL, '', 0, 0, 0, 0, 0, 'ascending', '', '', '', '', 'sourceText', NULL, NULL, 0, 0, '', '', '', '', 0, NULL, 0, 4, 0, 0, '', 0, '', '', NULL, '', '', NULL, '', NULL, '', '', '', '', 0, '', '', NULL, NULL, 0, 300, 0, 0, NULL, 0, 0, 0, 0, 0, 0, NULL, 'a:2:{i:0;s:0:\"\";i:1;s:0:\"\";}', 1, '', '', 'ascending', 0, 0, 0, 0, 0, '', NULL, 0, 'a:2:{s:5:\"value\";s:0:\"\";s:4:\"unit\";s:2:\"h2\";}', NULL, 'en', NULL, '', '', '', ''),
