(405, 'image', 104, 'tl_article', 256, 1730473264, 'a:2:{s:4:\"unit\";s:2:\"h6\";s:5:\"value\";s:98:\"Step into the forest’s embrace, where scenes of ancient woodlands unfold in breathtaking detail.\";}', '<p><span style=\"font-size: 0.875rem;\">Step into the forest’s embrace, where scenes of ancient woodlands unfold in breathtaking detail. Each piece captures the serene majesty of towering oaks, the intricate patterns of ivy-draped trunks, and the delicate beauty of wildflowers carpeting the forest floor. Streams weave through verdant canopies, reflecting the filtered sunlight and casting gentle ripples across still waters. In each image, you can almost feel the fresh forest air and hear the whisper of leaves stirred by a gentle breeze.</span></p>', 1, 0, 0, 0, 0xf4483c63983611ef92c7a8a1598b245a, '', '', 'a:3:{i:0;s:0:\"\";i:1;s:0:\"\";i:2;s:1:\"3\";}', NULL, 0, '', 'left', NULL, '', NULL, NULL, '', 0, 0, 0, 0, 0, 'ascending', '', '', '', '', 'sourceText', NULL, NULL, 0, 0, '', '', '', '', 0, NULL, 0, 4, 0, 0, '', 0, '', '', NULL, '', '', NULL, '', NULL, '', '', '', '', 0, '', '', NULL, NULL, 0, 300, 0, 0, NULL, 0, 0, 0, 0, 0, 0, NULL, 'a:2:{i:0;s:0:\"\";i:1;s:0:\"\";}', 0, '', '', 'ascending', 0, 0, 0, 0, 0, '', NULL, 0, 'a:2:{s:5:\"value\";s:0:\"\";s:4:\"unit\";s:2:\"h2\";}', NULL, 'en', NULL, '', '', '', ''),
(407, 'text', 108, 'tl_article', 128, 1730469263, 'a:2:{s:4:\"unit\";s:2:\"h4\";s:5:\"value\";s:18:\"Brief introduction\";}', '<ul>\n<li>\n<p><strong>Emma Rousseau – Founder &amp; Artistic Director</strong></p>\n<ul>\n<li>\n<p>Art historian and artist with a passion for cultural memory in art</p>\n</li>\n<li>\n<p>Curates exhibitions that merge contemporary and classical styles</p>\n</li>\n<li>\n<p>Focused on showcasing transformative, time-reflective art</p>\n</li>\n<li>\n<p><strong>Contact:</strong> <a rel=\"noopener\">Email Emma</a></p>\n</li>\n</ul>\n</li>\n<li>\n<p><strong>Liam Chen – Co-Founder &amp; Exhibition Curator</strong></p>\n<ul>\n<li>\n<p>Former museum director and curator specializing in story-driven exhibitions</p>\n</li>\n<li>\n<p>Brings fresh voices to the gallery by working closely with emerging artists</p>\n</li>\n<li>\n<p>Known for creating immersive, thematic art experiences</p>\n</li>\n<li>\n<p><strong>Contact:</strong> <a rel=\"noopener\">Email Liam</a></p>\n</li>\n</ul>\n</li>\n<li>\n<p><strong>Isabella Ferraro – Operations &amp; Community Outreach</strong></p>\n<ul>\n<li>\n<p>Leads gallery operations and community engagement initiatives</p>\n</li>\n<li>\n<p>Background in nonprofit arts management, focuses on accessibility and outreach</p>\n</li>\n<li>\n<p>Organizes educational programs, building the gallery’s role as a cultural hub</p>\n</li>\n<li>\n<p><strong>Contact:</strong> <a rel=\"noopener\">Email Isabella</a></p>\n</li>\n</ul>\n</li>\n</ul>', 0, 0, 0, 0, NULL, '', '', '', NULL, 0, '', 'above', NULL, '', NULL, NULL, '', 0, 0, 0, 0, 0, 'ascending', '', '', '', '', 'sourceText', NULL, NULL, 0, 0, '', '', '', '', 0, NULL, 0, 4, 0, 0, '', 0, '', '', NULL, '', '', NULL, '', NULL, '', '', '', '', 0, '', '', NULL, NULL, 0, 300, 0, 0, NULL, 0, 0, 0, 0, 0, 0, NULL, 'a:2:{i:0;s:0:\"\";i:1;s:0:\"\";}', 0, '', '', 'ascending', 0, 0, 0, 0, 0, '', NULL, 0, 'a:2:{s:5:\"value\";s:0:\"\";s:4:\"unit\";s:2:\"h2\";}', NULL, 'en', NULL, '', '', '', ''),
(409, 'text', 105, 'tl_article', 256, 1730471143, 'a:2:{s:4:\"unit\";s:2:\"h1\";s:5:\"value\";s:0:\"\";}', '<h2><span style=\"color: rgb(53, 152, 219);\">Meet the Founders</span></h2>\n<p><span style=\"color: rgb(0, 0, 0);\">Our gallery was founded by a team of art enthusiasts and visionaries, each bringing their unique expertise and passion to shape our mission of accessible and engaging art experiences. Learn more about our founders below, and feel free to reach out to connect with them directly.</span></p>\n<hr>\n<p><strong>Emma Clarke</strong><br><em>Co-Founder &amp; Artistic Director</em><br>Emma is the creative force behind our exhibitions, curating each show with a deep understanding of contemporary art and an eye for emerging talent. Her background in art history and curation brings both expertise and vision to the gallery, ensuring each exhibit offers a fresh, thought-provoking experience.<br><a rel=\"noopener\">Contact Emma</a></p>\n<hr>\n<p><strong>Liam Chen</strong><br><em>Co-Founder &amp; Operations Director</em><br>With a background in business management and logistics, Liam oversees the gallery’s day-to-day operations, coordinating everything from exhibition installations to event planning. His dedication to smooth operations allows the creative team to thrive while ensuring our visitors enjoy a seamless experience.<br><a rel=\"noopener\">Contact Liam</a></p>\n<hr>\n<p><strong>Sophia Martinez</strong><br><em>Co-Founder &amp; Community Engagement Director</em><br>Sophia specializes in building connections between the gallery and the community. Through outreach programs, workshops, and local collaborations, she ensures the gallery remains a welcoming and accessible space for all. Sophia’s passion for inclusion drives many of our community-focused initiatives.<br><a rel=\"noopener\">Contact Sophia</a></p>\n<hr>\n<p><strong>James Walker</strong><br><em>Co-Founder &amp; Marketing Director</em><br>James leads the gallery’s marketing and public relations efforts, crafting campaigns that bring our exhibitions to a wider audience. With his experience in digital marketing and branding, James ensures that the gallery’s mission resonates beyond our walls, attracting art lovers from near and far.<br><a rel=\"noopener\">Contact James</a></p>\n<hr>\n<p>Each of our founders brings their unique skills and dedication to foster a gallery experience that is engaging, inclusive, and continually evolving. We welcome you to connect with them to learn more about our vision and upcoming events.</p>', 0, 0, 0, 0, NULL, '', '', '', NULL, 0, '', 'above', NULL, '', NULL, NULL, '', 0, 0, 0, 0, 0, 'ascending', '', '', '', '', 'sourceText', NULL, NULL, 0, 0, '', '', '', '', 0, NULL, 0, 4, 0, 0, '', 0, '', '', NULL, '', '', NULL, '', NULL, '', '', '', '', 0, '', '', NULL, NULL, 0, 300, 0, 0, NULL, 0, 0, 0, 0, 0, 0, NULL, 'a:2:{i:0;s:0:\"\";i:1;s:0:\"\";}', 0, '', '', 'ascending', 0, 0, 0, 0, 0, '', NULL, 0, 'a:2:{s:5:\"value\";s:0:\"\";s:4:\"unit\";s:2:\"h2\";}', NULL, 'en', NULL, '', '', '', ''),
(410, 'image', 104, 'tl_article', 512, 1730473170, 'a:2:{s:4:\"unit\";s:2:\"h6\";s:5:\"value\";s:188:\"Beyond the forest, the gallery leads you into wide, open green landscapes—rolling hills dotted with trees, sprawling fields of wild grasses, and moss-covered rocks kissed by morning dew.\";}', '<p>Beyond the forest, the gallery leads you into wide, open green landscapes—rolling hills dotted with trees, sprawling fields of wild grasses, and moss-covered rocks kissed by morning dew. Each scene invites you to lose yourself in the beauty of nature’s untouched places, from quiet meadows bursting with spring colors to misty mountain trails winding through evergreen woods. These landscapes remind us of the earth’s ability to heal, inspire, and ground us, offering a tranquil escape from the demands of modern life.</p>', 1, 0, 0, 0, 0xa9687243983811ef92c7a8a1598b245a, '', '', 'a:3:{i:0;s:0:\"\";i:1;s:0:\"\";i:2;s:1:\"3\";}', NULL, 0, '', 'above', NULL, '', NULL, NULL, '', 0, 0, 0, 0, 0, 'ascending', '', '', '', '', 'sourceText', NULL, NULL, 0, 0, '', '', '', '', 0, NULL, 0, 4, 0, 0, '', 0, '', '', NULL, '', '', NULL, '', NULL, '', '', '', '', 0, '', '', NULL, NULL, 0, 300, 0, 0, NULL, 0, 0, 0, 0, 0, 0, NULL, 'a:2:{i:0;s:0:\"\";i:1;s:0:\"\";}', 0, '', '', 'ascending', 0, 0, 0, 0, 0, '', NULL, 0, 'a:2:{s:5:\"value\";s:0:\"\";s:4:\"unit\";s:2:\"h2\";}', NULL, 'en', NULL, '', '', '', ''),
(411, 'image', 104, 'tl_article', 640, 1730473242, 'a:2:{s:4:\"unit\";s:2:\"h6\";s:5:\"value\";s:193:\"Whether you’re an art lover, a nature enthusiast, or simply someone seeking a moment of peace, the Nature’s Sanctuary Gallery provides a sanctuary in which to pause, breathe, and reconnect.\";}', '<p>Whether you’re an art lover, a nature enthusiast, or simply someone seeking a moment of peace, the <strong>Nature’s Sanctuary Gallery</strong> provides a sanctuary in which to pause, breathe, and reconnect with the timeless beauty of green landscapes.</p>', 1, 0, 0, 0, 0xdf60f8e4983611ef92c7a8a1598b245a, '', '', 'a:3:{i:0;s:0:\"\";i:1;s:0:\"\";i:2;s:1:\"3\";}', NULL, 0, '', 'above', NULL, '', NULL, NULL, '', 0, 0, 0, 0, 0, 'ascending', '', '', '', '', 'sourceText', NULL, NULL, 0, 0, '', '', '', '', 0, NULL, 0, 4, 0, 0, '', 0, '', '', NULL, '', '', NULL, '', NULL, '', '', '', '', 0, '', '', NULL, NULL, 0, 300, 0, 0, NULL, 0, 0, 0, 0, 0, 0, NULL, 'a:2:{i:0;s:0:\"\";i:1;s:0:\"\";}', 0, '', '', 'ascending', 0, 0, 0, 0, 0, '', NULL, 0, 'a:2:{s:5:\"value\";s:0:\"\";s:4:\"unit\";s:2:\"h2\";}', NULL, 'en', NULL, '', '', '', '');
