(414, 'headline', 100, 'tl_article', 112, 1730469221, 'a:2:{s:4:\"unit\";s:2:\"h2\";s:5:\"value\";s:24:\"Introduction at a Glance\";}', NULL, 0, 0, 0, 0, NULL, '', '', '', NULL, 0, '', 'above', NULL, '', NULL, NULL, '', 0, 0, 0, 0, 0, 'ascending', '', '', '', '', 'sourceText', NULL, NULL, 0, 0, '', '', '', '', 0, NULL, 0, 4, 0, 0, '', 0, '', '', NULL, '', '', NULL, '', NULL, '', '', '', '', 0, '', '', NULL, NULL, 0, 300, 0, 0, NULL, 0, 0, 0, 0, 0, 0, NULL, 'a:2:{i:0;s:0:\"\";i:1;s:0:\"\";}', 0, '', '', 'ascending', 0, 0, 0, 0, 0, '', NULL, 0, 'a:2:{s:5:\"value\";s:0:\"\";s:4:\"unit\";s:2:\"h2\";}', NULL, 'en', NULL, '', '', '', ''),
(415, 'text', 108, 'tl_article', 256, 1730469405, 'a:2:{s:4:\"unit\";s:2:\"h4\";s:5:\"value\";s:50:\"Core Values of Impressions of Time: Art That Moves\";}', '<ol>\n<li>\n<p><strong>Timeless Connection</strong><br>We believe in art’s unique power to transcend time and space, linking past and present through shared emotions, experiences, and reflections. Our exhibitions are designed to create connections that resonate beyond the walls of the gallery.</p>\n</li>\n<li>\n<p><strong>Curatorial Excellence</strong><br>Quality and integrity are at the heart of our curatorial work. We carefully select each piece, ensuring that every exhibit is thoughtfully curated to inspire, educate, and spark dialogue among viewers.</p>\n</li>\n<li>\n<p><strong>Innovation &amp; Tradition</strong><br>Bridging classical and contemporary, we celebrate both tradition and innovation. By showcasing diverse artistic styles, we highlight how art evolves while honoring the techniques and values that have shaped it across centuries.</p>\n</li>\n<li>\n<p><strong>Community Engagement</strong><br>We’re committed to making art accessible and engaging for everyone. Through community programs, workshops, and partnerships, we bring art to local schools and neighborhoods, fostering a shared cultural appreciation.</p>\n</li>\n<li>\n<p><strong>Inspiration &amp; Discovery</strong><br><em>Impressions of Time</em> serves as a place for discovery, where art inspires curiosity, wonder, and new ways of seeing the world. We encourage visitors to explore, reflect, and find personal meaning in every piece.</p>\n</li>\n<li>\n<p><strong>Sustainability &amp; Responsibility</strong><br>As a gallery, we prioritize sustainable practices, from eco-friendly materials to supporting artists who engage with environmental themes. We believe art can reflect and shape our responsibility to the world around us.</p>\n</li>\n</ol>\n<p>Our core values shape <em>Impressions of Time</em> into a gallery where art not only moves us but also encourages us to understand our place in the flow of time.</p>', 0, 0, 0, 0, NULL, '', '', '', NULL, 0, '', 'above', NULL, '', NULL, NULL, '', 0, 0, 0, 0, 0, 'ascending', '', '', '', '', 'sourceText', NULL, NULL, 0, 0, '', '', '', '', 0, NULL, 0, 4, 0, 0, '', 0, '', '', NULL, '', '', NULL, '', NULL, '', '', '', '', 0, '', '', NULL, NULL, 0, 300, 0, 0, NULL, 0, 0, 0, 0, 0, 0, NULL, 'a:2:{i:0;s:0:\"\";i:1;s:0:\"\";}', 0, '', '', 'ascending', 0, 0, 0, 0, 0, '', NULL, 0, 'a:2:{s:5:\"value\";s:0:\"\";s:4:\"unit\";s:2:\"h2\";}', NULL, 'en', NULL, '', '', '', ''),
(416, 'text', 113, 'tl_article', 128, 1730472627, 'a:2:{s:4:\"unit\";s:2:\"h2\";s:5:\"value\";s:0:\"\";}', '<h1><span style=\"color: rgb(22, 145, 121);\">Natures Beauties</span></h1>\n<p><em>Nature&#39;s Essence, Captured in Every Frame</em></p>\n<p>&nbsp;</p>\n<p>The <span style=\"color: rgb(22, 145, 121);\"><strong>Nature’s Gallery</strong></span> was founded by a group of passionate artists and environmentalists who believed in the power of nature’s beauty to inspire change and inner peace. Originating as a small community project in a woodland village, the gallery began as an open-air exhibit, where local artists displayed their works among the trees and streams that inspired them. Each piece told a story of respect, wonder, and the need to preserve the delicate ecosystems that surround us.</p>\n<p>As interest grew, so did the gallery’s mission. The founders expanded their reach, inviting photographers, painters, and sculptors from all over the world to contribute works that captured the soul of green landscapes. With every brushstroke and photograph, they aimed to spark a profound appreciation for our planet’s natural beauty and foster a connection between people and the earth. Today, <span style=\"color: rgb(22, 145, 121);\"><strong>Nature’s Gallery</strong></span> is both a haven for art lovers and a call to preserve the green spaces that offer peace, balance, and renewal.</p>', 0, 0, 0, 0, NULL, '', '', '', NULL, 0, '', 'above', NULL, '', NULL, NULL, '', 0, 0, 0, 0, 0, 'ascending', '', '', '', '', 'sourceText', NULL, NULL, 0, 0, '', '', '', '', 0, NULL, 0, 4, 0, 0, '', 0, '', '', NULL, '', '', NULL, '', NULL, '', '', '', '', 0, '', '', NULL, NULL, 0, 300, 0, 0, NULL, 0, 0, 0, 0, 0, 0, NULL, 'a:2:{i:0;s:0:\"\";i:1;s:0:\"\";}', 0, '', '', 'ascending', 0, 0, 0, 0, 0, '', NULL, 0, 'a:2:{s:5:\"value\";s:0:\"\";s:4:\"unit\";s:2:\"h2\";}', NULL, 'en', NULL, '', '', '', ''),
