(499, 'text', 127, 'tl_article', 128, 1730477620, 'a:2:{s:4:\"unit\";s:2:\"h4\";s:5:\"value\";s:18:\"Brief introduction\";}', '<ul>\n<li>\n<p><strong>Emma Rousseau – Founder &amp; Artistic Director</strong></p>\n<ul>\n<li>\n<p>Art historian and artist with a passion for cultural memory in art</p>\n</li>\n<li>\n<p>Curates exhibitions that merge contemporary and classical styles</p>\n</li>\n<li>\n<p>Focused on showcasing transformative, time-reflective art</p>\n</li>\n<li>\n<p><strong>Contact:</strong> <a rel=\"noopener\">Email Emma</a></p>\n</li>\n</ul>\n</li>\n<li>\n<p><strong>Liam Chen – Co-Founder &amp; Exhibition Curator</strong></p>\n<ul>\n<li>\n<p>Former museum director and curator specializing in story-driven exhibitions</p>\n</li>\n<li>\n<p>Brings fresh voices to the gallery by working closely with emerging artists</p>\n</li>\n<li>\n<p>Known for creating immersive, thematic art experiences</p>\n</li>\n<li>\n<p><strong>Contact:</strong> <a rel=\"noopener\">Email Liam</a></p>\n</li>\n</ul>\n</li>\n<li>\n<p><strong>Isabella Ferraro – Operations &amp; Community Outreach</strong></p>\n<ul>\n<li>\n<p>Leads gallery operations and community engagement initiatives</p>\n</li>\n<li>\n<p>Background in nonprofit arts management, focuses on accessibility and outreach</p>\n</li>\n<li>\n<p>Organizes educational programs, building the gallery’s role as a cultural hub</p>\n</li>\n<li>\n<p><strong>Contact:</strong> <a rel=\"noopener\">Email Isabella</a></p>\n</li>\n</ul>\n</li>\n</ul>', 0, 0, 0, 1, NULL, '', '', '', NULL, 0, '', 'above', NULL, '', NULL, NULL, '', 0, 0, 0, 0, 0, 'ascending', '', '', '', '', 'sourceText', NULL, NULL, 0, 0, '', '', '', '', 0, NULL, 0, 4, 0, 0, '', 0, '', '', NULL, '', '', NULL, '', NULL, '', '', '', '', 0, '', '', NULL, NULL, 0, 300, 0, 0, NULL, 0, 0, 0, 0, 0, 0, NULL, 'a:2:{i:0;s:0:\"\";i:1;s:0:\"\";}', 0, '', '', 'ascending', 0, 0, 0, 0, 0, '', NULL, 0, 'a:2:{s:5:\"value\";s:0:\"\";s:4:\"unit\";s:2:\"h2\";}', NULL, 'en', NULL, '', '', '', ''),
(500, 'text', 127, 'tl_article', 256, 1730477574, 'a:2:{s:4:\"unit\";s:2:\"h4\";s:5:\"value\";s:50:\"Core Values of Impressions of Time: Art That Moves\";}', '<ol>\n<li>\n<p><strong>Timeless Connection</strong><br>We believe in art’s unique power to transcend time and space, linking past and present through shared emotions, experiences, and reflections. Our exhibitions are designed to create connections that resonate beyond the walls of the gallery.</p>\n</li>\n<li>\n<p><strong>Curatorial Excellence</strong><br>Quality and integrity are at the heart of our curatorial work. We carefully select each piece, ensuring that every exhibit is thoughtfully curated to inspire, educate, and spark dialogue among viewers.</p>\n</li>\n<li>\n<p><strong>Innovation &amp; Tradition</strong><br>Bridging classical and contemporary, we celebrate both tradition and innovation. By showcasing diverse artistic styles, we highlight how art evolves while honoring the techniques and values that have shaped it across centuries.</p>\n</li>\n<li>\n<p><strong>Community Engagement</strong><br>We’re committed to making art accessible and engaging for everyone. Through community programs, workshops, and partnerships, we bring art to local schools and neighborhoods, fostering a shared cultural appreciation.</p>\n</li>\n<li>\n<p><strong>Inspiration &amp; Discovery</strong><br><em>Impressions of Time</em> serves as a place for discovery, where art inspires curiosity, wonder, and new ways of seeing the world. We encourage visitors to explore, reflect, and find personal meaning in every piece.</p>\n</li>\n<li>\n<p><strong>Sustainability &amp; Responsibility</strong><br>As a gallery, we prioritize sustainable practices, from eco-friendly materials to supporting artists who engage with environmental themes. We believe art can reflect and shape our responsibility to the world around us.</p>\n</li>\n</ol>\n<p>Our core values shape <em>Impressions of Time</em> into a gallery where art not only moves us but also encourages us to understand our place in the flow of time.</p>', 0, 0, 0, 1, NULL, '', '', '', NULL, 0, '', 'above', NULL, '', NULL, NULL, '', 0, 0, 0, 0, 0, 'ascending', '', '', '', '', 'sourceText', NULL, NULL, 0, 0, '', '', '', '', 0, NULL, 0, 4, 0, 0, '', 0, '', '', NULL, '', '', NULL, '', NULL, '', '', '', '', 0, '', '', NULL, NULL, 0, 300, 0, 0, NULL, 0, 0, 0, 0, 0, 0, NULL, 'a:2:{i:0;s:0:\"\";i:1;s:0:\"\";}', 0, '', '', 'ascending', 0, 0, 0, 0, 0, '', NULL, 0, 'a:2:{s:5:\"value\";s:0:\"\";s:4:\"unit\";s:2:\"h2\";}', NULL, 'en', NULL, '', '', '', ''),
