(503, 'table', 128, 'tl_article', 256, 1730471581, 'a:2:{s:4:\"unit\";s:2:\"h4\";s:5:\"value\";s:29:\"Art categories of the gallery\";}', '<ul>\n<li>\n<h6><strong>Impressionism</strong><br>Celebrating the movement that captures fleeting moments with visible brush strokes and vibrant light.</h6>\n</li>\n<li>\n<h6><strong>Contemporary Art</strong><br>Featuring modern works that reflect current themes and societal issues, employing diverse mediums and styles.</h6>\n</li>\n<li>\n<h6><strong>Abstract Art</strong><br>Showcasing pieces that emphasize color, form, and lines rather than representational imagery.</h6>\n</li>\n<li>\n<h6><strong>Sculpture</strong><br>Including both traditional and contemporary sculptures that explore form and space in three dimensions.</h6>\n</li>\n<li>\n<h6><strong>Photography</strong><br>Highlighting artistic photography that captures moments in time, blending artistic vision with technical skill.</h6>\n</li>\n</ul>', 0, 0, 0, 0, NULL, '', '', '', NULL, 0, '', 'above', NULL, '', NULL, , '', 1, 0, 0, 0, 0, 'ascending', '', '', '', '', 'sourceText', NULL, NULL, 0, 0, '', '', '', '', 0, NULL, 0, 4, 0, 0, '', 0, '', '', NULL, '', '', NULL, '', NULL, '', '', '', '', 0, '', '', NULL, NULL, 0, 300, 0, 0, NULL, 0, 0, 0, 0, 0, 0, NULL, 'a:2:{i:0;s:0:\"\";i:1;s:0:\"\";}', 0, '', '', 'ascending', 0, 0, 0, 0, 0, '', NULL, 0, 'a:2:{s:5:\"value\";s:0:\"\";s:4:\"unit\";s:2:\"h2\";}', NULL, 'en', NULL, '', '', '', ''),
