(512, 'text', 113, 'tl_article', 416, 1730472166, 'a:2:{s:4:\"unit\";s:2:\"h2\";s:5:\"value\";s:15:\"2. Lucas Rivera\";}', '<p>Role: Co-Founder &amp; Head of Photography<br>Lucas’s love for forest landscapes began in his youth, photographing the woodlands near his hometown. His award-winning nature photography has been featured internationally. As Head of Photography, he mentors new photographers and coordinates seasonal workshops in the gallery.</p>\n<p><a rel=\"noopener\">Contact Lucas</a></p>', 0, 0, 0, 0, NULL, '', '', '', NULL, 0, '', 'above', NULL, '', NULL, NULL, '', 0, 0, 0, 0, 0, 'ascending', '', '', '', '', 'sourceText', NULL, NULL, 0, 0, '', '', '', '', 0, NULL, 0, 4, 0, 0, '', 0, '', '', NULL, '', '', NULL, '', NULL, '', '', '', '', 0, '', '', NULL, NULL, 0, 300, 0, 0, NULL, 0, 0, 0, 0, 0, 0, NULL, 'a:2:{i:0;s:0:\"\";i:1;s:0:\"\";}', 0, '', '', 'ascending', 0, 0, 0, 0, 0, '', NULL, 0, 'a:2:{s:5:\"value\";s:0:\"\";s:4:\"unit\";s:2:\"h2\";}', NULL, 'en', NULL, '', '', '', ''),
