(518, 'text', 113, 'tl_article', 496, 1730472295, 'a:2:{s:4:\"unit\";s:2:\"h2\";s:5:\"value\";s:13:\"3. Sophie Kim\";}', '<p>Role: Environmental Liaison &amp; Community Outreach Coordinator<br>Sophie brings her expertise in environmental science to the gallery, fostering partnerships with conservation organizations. She leads community outreach programs and organizes events that connect art lovers with initiatives to protect our green spaces.</p>\n<p><a rel=\"noopener\">Contact Sophie</a></p>\n<p>&nbsp;</p>', 0, 0, 0, 0, NULL, '', '', '', NULL, 0, '', 'above', NULL, '', NULL, NULL, '', 0, 0, 0, 0, 0, 'ascending', '', '', '', '', 'sourceText', NULL, NULL, 0, 0, '', '', '', '', 0, NULL, 0, 4, 0, 0, '', 0, '', '', NULL, '', '', NULL, '', NULL, '', '', '', '', 0, '', '', NULL, NULL, 0, 300, 0, 0, NULL, 0, 0, 0, 0, 0, 0, NULL, 'a:2:{i:0;s:0:\"\";i:1;s:0:\"\";}', 0, '', '', 'ascending', 0, 0, 0, 0, 0, '', NULL, 0, 'a:2:{s:5:\"value\";s:0:\"\";s:4:\"unit\";s:2:\"h2\";}', NULL, 'en', NULL, '', '', '', ''),
