(527, 'text', 131, 'tl_article', 128, 1730836760, 'a:2:{s:4:\"unit\";s:2:\"h2\";s:5:\"value\";s:0:\"\";}', '<h1><span style=\"color: rgb(0, 99, 80);\">Natures Beauties</span></h1>\n<p><em>Nature&#39;s Essence, Captured in Every Frame</em></p>\n<p>&nbsp;</p>\n<p>The <span style=\"color: rgb(0, 99, 80);\"><strong>Nature’s Gallery</strong></span> was founded by a group of passionate artists and environmentalists who believed in the power of nature’s beauty to inspire change and inner peace. Originating as a small community project in a woodland village, the gallery began as an open-air exhibit, where local artists displayed their works among the trees and streams that inspired them. Each piece told a story of respect, wonder, and the need to preserve the delicate ecosystems that surround us.</p>\n<p>As interest grew, so did the gallery’s mission. The founders expanded their reach, inviting photographers, painters, and sculptors from all over the world to contribute works that captured the soul of green landscapes. With every brushstroke and photograph, they aimed to spark a profound appreciation for our planet’s natural beauty and foster a connection between people and the earth. Today, <span style=\"color: rgb(0, 99, 80);\"><strong>Nature’s Gallery</strong></span> is both a haven for art lovers and a call to preserve the green spaces that offer peace, balance, and renewal.</p>', 0, 0, 0, 0, NULL, '', '', '', NULL, 0, '', 'above', NULL, '', NULL, NULL, '', 0, 0, 0, 0, 0, 'ascending', '', '', '', '', 'sourceText', NULL, NULL, 0, 0, '', '', '', '', 0, NULL, 0, 4, 0, 0, '', 0, '', '', NULL, '', '', NULL, '', NULL, '', '', '', '', 0, '', '', NULL, NULL, 0, 300, 0, 0, NULL, 0, 0, 0, 0, 0, 0, NULL, 'a:2:{i:0;s:0:\"\";i:1;s:0:\"\";}', 0, '', '', 'ascending', 0, 0, 0, 0, 0, '', NULL, 0, 'a:2:{s:5:\"value\";s:0:\"\";s:4:\"unit\";s:2:\"h2\";}', NULL, 'en', NULL, '', '', '', ''),
