(530, 'text', 131, 'tl_article', 384, 1730473790, 'a:2:{s:4:\"unit\";s:2:\"h2\";s:5:\"value\";s:17:\"1. Emma Hartfield\";}', '<p>Role: Founder &amp; Curator<br>Emma, a lifelong artist and environmental advocate, dreamed of a space where art could bridge the gap between people and nature. With over 20 years of experience in art curation, she carefully selects each exhibit, ensuring it aligns with the gallery’s mission to inspire a deep appreciation for the natural world.</p>\n<p><a rel=\"noopener\">Contact Emma</a></p>', 0, 0, 0, 0, NULL, '', '', '', NULL, 0, '', 'above', NULL, '', NULL, NULL, '', 0, 0, 0, 0, 0, 'ascending', '', '', '', '', 'sourceText', NULL, NULL, 0, 0, '', '', '', '', 0, NULL, 0, 4, 0, 0, '', 0, '', '', NULL, '', '', NULL, '', NULL, '', '', '', '', 0, '', '', NULL, NULL, 0, 300, 0, 0, NULL, 0, 0, 0, 0, 0, 0, NULL, 'a:2:{i:0;s:0:\"\";i:1;s:0:\"\";}', 0, '', '', 'ascending', 0, 0, 0, 0, 0, '', NULL, 0, 'a:2:{s:5:\"value\";s:0:\"\";s:4:\"unit\";s:2:\"h2\";}', NULL, 'en', NULL, '', '', '', ''),
