(539, 'text', 131, 'tl_article', 510, 1730473790, 'a:2:{s:4:\"unit\";s:2:\"h2\";s:5:\"value\";s:15:\"4. Daniel Singh\";}', '<p>Role: Director of Operations<br>Daniel manages the gallery’s day-to-day operations, from exhibition planning to visitor experience. With a background in sustainable business, he ensures that the gallery not only showcases nature but operates with eco-friendly practices.</p>\n<p><a rel=\"noopener\">Contact Daniel</a></p>', 0, 0, 0, 0, NULL, '', '', '', NULL, 0, '', 'above', NULL, '', NULL, NULL, '', 0, 0, 0, 0, 0, 'ascending', '', '', '', '', 'sourceText', NULL, NULL, 0, 0, '', '', '', '', 0, NULL, 0, 4, 0, 0, '', 0, '', '', NULL, '', '', NULL, '', NULL, '', '', '', '', 0, '', '', NULL, NULL, 0, 300, 0, 0, NULL, 0, 0, 0, 0, 0, 0, NULL, 'a:2:{i:0;s:0:\"\";i:1;s:0:\"\";}', 0, '', '', 'ascending', 0, 0, 0, 0, 0, '', NULL, 0, 'a:2:{s:5:\"value\";s:0:\"\";s:4:\"unit\";s:2:\"h2\";}', NULL, 'en', NULL, '', '', '', ''),
