(541, 'text', 131, 'tl_article', 512, 1730836811, 'a:2:{s:4:\"unit\";s:2:\"h2\";s:5:\"value\";s:0:\"\";}', '<h2>Our Core Values</h2>\n<p>At <span style=\"color: rgb(0, 99, 80);\"><strong>Nature’s Sanctuary Gallery</strong></span>, our mission is guided by a deep respect for nature and a commitment to inspiring positive change through art. Our core values reflect this dedication and drive everything we do:</p>\n<ol>\n<li><strong>Reverence for Nature</strong><br>We believe that nature is a profound source of beauty and inspiration. Every piece in our gallery celebrates the earth’s landscapes, reminding us of the irreplaceable value of our natural surroundings.</li>\n<li><strong>Art as Advocacy</strong><br>We view art as a powerful voice for change. Through carefully curated exhibitions, we aim to raise awareness about environmental preservation and inspire actions that protect our green spaces for future generations.</li>\n<li><strong>Community Engagement</strong><br>We are committed to creating a space that welcomes everyone. From workshops to public events, we strive to build a community that connects people with nature and encourages collective responsibility for its protection.</li>\n<li><strong>Sustainability in Practice</strong><br>We believe that honoring nature begins with our actions. Every aspect of our gallery, from operational choices to materials used in our exhibits, reflects our commitment to sustainability and minimizing our environmental impact.</li>\n<li><strong>Lifelong Learning</strong><br>We see the gallery as a place of continuous discovery and growth. By sharing knowledge and insights into nature and conservation, we hope to deepen visitors’ appreciation and understanding of the natural world.</li>\n<li><strong>Preservation Through Collaboration</strong><br>We recognize that true impact requires partnership. Through collaborations with artists, environmental groups, and local communities, we work together to preserve the landscapes we all cherish.</li>\n</ol>\n<p>These core values shape the experience at <span style=\"color: rgb(0, 99, 80);\"><strong>Nature’s Sanctuary Gallery</strong></span>, creating a space where art and nature intersect to inspire, educate, and advocate for a greener future.</p>', 0, 0, 0, 0, NULL, '', '', '', NULL, 0, '', 'above', NULL, '', NULL, NULL, '', 0, 0, 0, 0, 0, 'ascending', '', '', '', '', 'sourceText', NULL, NULL, 0, 0, '', '', '', '', 0, NULL, 0, 4, 0, 0, '', 0, '', '', NULL, '', '', NULL, '', NULL, '', '', '', '', 0, '', '', NULL, NULL, 0, 300, 0, 0, NULL, 0, 0, 0, 0, 0, 0, NULL, 'a:2:{i:0;s:0:\"\";i:1;s:0:\"\";}', 0, '', '', 'ascending', 0, 0, 0, 0, 0, '', NULL, 0, 'a:2:{s:5:\"value\";s:0:\"\";s:4:\"unit\";s:2:\"h2\";}', NULL, 'en', NULL, '', '', '', '');
