(543, 'text', 131, 'tl_article', 768, 1730473790, 'a:2:{s:4:\"unit\";s:2:\"h2\";s:5:\"value\";s:0:\"\";}', '<p>Here are three esteemed art organizations that share our commitment to celebrating nature through art:</p>\n<ol>\n<li>\n<p><strong>Artists for Conservation</strong><br>A global network of artists dedicated to supporting the environment through art that celebrates nature.</p>\n<div class=\"relative inline-flex items-center\"><a class=\"flex h-[22px] items-center rounded-xl px-2 text-[0.5em] !font-medium uppercase bg-[#f4f4f4] !text-token-text-secondary hover:bg-token-text-primary hover:!text-token-main-surface-secondary dark:bg-token-main-surface-secondary dark:hover:bg-token-text-primary relative top-[-0.094rem]\" href=\"https://www.artistsforconservation.org/\" target=\"_blank\" rel=\"noopener\"><span class=\"truncate\">Artists for Conservation</span></a></div>\n<p>&nbsp;</p>\n</li>\n<li>\n<p><strong>Nature in Art</strong><br>The world&#39;s first museum and art gallery dedicated exclusively to fine, decorative, and applied art inspired by nature.</p>\n<div class=\"relative inline-flex items-center\"><a class=\"flex h-[22px] items-center rounded-xl px-2 text-[0.5em] !font-medium uppercase bg-[#f4f4f4] !text-token-text-secondary hover:bg-token-text-primary hover:!text-token-main-surface-secondary dark:bg-token-main-surface-secondary dark:hover:bg-token-text-primary relative top-[-0.094rem]\" href=\"https://natureinart.org.uk/\" target=\"_blank\" rel=\"noopener\"><span class=\"truncate\">Nature in Art</span></a></div>\n<p>&nbsp;</p>\n</li>\n<li>\n<p><strong>Naturalist Gallery of Contemporary Art</strong><br>A gallery representing a diverse roster of contemporary artists whose works explore themes of nature and the environment.</p>\n<div class=\"relative inline-flex items-center\"><a class=\"flex h-[22px] items-center rounded-xl px-2 text-[0.5em] !font-medium uppercase bg-[#f4f4f4] !text-token-text-secondary hover:bg-token-text-primary hover:!text-token-main-surface-secondary dark:bg-token-main-surface-secondary dark:hover:bg-token-text-primary relative top-[-0.094rem]\" href=\"https://naturalist.gallery/\" target=\"_blank\" rel=\"noopener\"><span class=\"truncate\">Naturalist Gallery</span></a></div>\n<p>&nbsp;</p>\n</li>\n</ol>\n<p>These organizations exemplify the profound connection between art and the natural world, inspiring appreciation and conservation through their exhibitions and programs.</p>\n<div class=\"absolute h-[60px]\">&nbsp;</div>', 0, 0, 0, 0, NULL, '', '', '', NULL, 0, '', 'above', NULL, '', NULL, NULL, '', 0, 0, 0, 0, 0, 'ascending', '', '', '', '', 'sourceText', NULL, NULL, 0, 0, '', '', '', '', 0, NULL, 0, 4, 0, 0, '', 0, '', '', NULL, '', '', NULL, '', NULL, '', '', '', '', 0, '', '', NULL, NULL, 0, 300, 0, 0, NULL, 0, 0, 0, 0, 0, 0, NULL, 'a:2:{i:0;s:0:\"\";i:1;s:0:\"\";}', 0, '', '', 'ascending', 0, 0, 0, 0, 0, '', NULL, 0, 'a:2:{s:5:\"value\";s:0:\"\";s:4:\"unit\";s:2:\"h2\";}', NULL, 'en', NULL, '', '', '', ''),
