(548, 'text', 126, 'tl_article', 512, 1730477258, 'a:2:{s:4:\"unit\";s:2:\"h2\";s:5:\"value\";s:0:\"\";}', '<p>Founded by artist and historian Emma Rousseau, <em>Impressions of Time</em> began as a modest studio nestled in an old industrial district. Emma’s vision was to create a space where art transcends eras, where each piece speaks to the collective human experience across ages. Inspired by her years of travel and research, she curated works that resonate with both the past and present, bridging classical and modern styles to showcase how art evolves with society yet captures timeless emotions.</p>\n<p>As the gallery grew, it became a gathering point for artists, thinkers, and art lovers who were captivated by the gallery’s ethos: to show art not just as beautiful objects, but as narratives that move us, capturing fleeting moments and shaping our perception of history. Each exhibition carefully selects pieces that explore the nuances of time—whether through the subtle aging of materials or the subjects captured in intimate, transformative moments.</p>\n<p>Today, <em>Impressions of Time</em> stands as a celebrated institution, known for its dynamic exhibitions and dedication to art that embodies both movement and memory, inviting viewers to step into a world where time itself becomes part of the art.</p>', 0, 0, 0, 0, NULL, '', '', '', NULL, 0, '', 'above', NULL, '', NULL, NULL, '', 0, 0, 0, 0, 0, 'ascending', '', '', '', '', 'sourceText', NULL, NULL, 0, 0, '', '', '', '', 0, NULL, 0, 4, 0, 0, '', 0, '', '', NULL, '', '', NULL, '', NULL, '', '', '', '', 0, '', '', NULL, NULL, 0, 300, 0, 0, NULL, 0, 0, 0, 0, 0, 0, NULL, 'a:2:{i:0;s:0:\"\";i:1;s:0:\"\";}', 0, '', '', 'ascending', 0, 0, 0, 0, 0, '', NULL, 0, 'a:2:{s:5:\"value\";s:0:\"\";s:4:\"unit\";s:2:\"h2\";}', NULL, 'en', NULL, '', '', '', ''),
