(550, 'sliderStart', 132, 'tl_article', 256, 1730827406, 'a:2:{s:4:\"unit\";s:2:\"h2\";s:5:\"value\";s:0:\"\";}', NULL, 0, 0, 0, 0, NULL, '', '', '', NULL, 0, '', 'above', NULL, '', NULL, NULL, '', 0, 0, 0, 0, 0, 'ascending', '', '', '', '', 'sourceText', NULL, NULL, 0, 0, '', '', '', '', 0, NULL, 0, 4, 0, 0, '', 0, '', '', NULL, '', '', NULL, '', NULL, '', '', '', '', 0, '', '', NULL, NULL, 0, 300, 0, 0, NULL, 0, 0, 0, 0, 0, 0, NULL, 'a:2:{i:0;s:0:\"\";i:1;s:0:\"\";}', 0, '', '', 'ascending', 0, 0, 0, 0, 0, '', NULL, 0, 'a:2:{s:5:\"value\";s:0:\"\";s:4:\"unit\";s:2:\"h2\";}', NULL, 'en', NULL, '', '', '', ''),
(551, 'image', 132, 'tl_article', 384, 1730827446, 'a:2:{s:4:\"unit\";s:2:\"h6\";s:5:\"value\";s:98:\"Step into the forest’s embrace, where scenes of ancient woodlands unfold in breathtaking detail.\";}', '<p><span style=\"font-size: 0.875rem;\">Step into the forest’s embrace, where scenes of ancient woodlands unfold in breathtaking detail. Each piece captures the serene majesty of towering oaks, the intricate patterns of ivy-draped trunks, and the delicate beauty of wildflowers carpeting the forest floor. Streams weave through verdant canopies, reflecting the filtered sunlight and casting gentle ripples across still waters. In each image, you can almost feel the fresh forest air and hear the whisper of leaves stirred by a gentle breeze.</span></p>', 1, 0, 0, 0, 0x82e8825d9b9911ef92c7a8a1598b245a, '', '', 'a:3:{i:0;s:0:\"\";i:1;s:0:\"\";i:2;s:1:\"3\";}', NULL, 0, '', 'left', NULL, '', NULL, NULL, '', 0, 0, 0, 0, 0, 'ascending', '', '', '', '', 'sourceText', NULL, NULL, 0, 0, '', '', '', '', 0, NULL, 0, 4, 0, 0, '', 0, '', '', NULL, '', '', NULL, '', NULL, '', '', '', '', 0, '', '', NULL, NULL, 0, 300, 0, 0, NULL, 0, 0, 0, 0, 0, 0, NULL, 'a:2:{i:0;s:0:\"\";i:1;s:0:\"\";}', 0, '', '', 'ascending', 0, 0, 0, 0, 0, '', NULL, 0, 'a:2:{s:5:\"value\";s:0:\"\";s:4:\"unit\";s:2:\"h2\";}', NULL, 'en', NULL, '', '', '', ''),
(552, 'image', 132, 'tl_article', 512, 1730827438, 'a:2:{s:4:\"unit\";s:2:\"h6\";s:5:\"value\";s:188:\"Beyond the forest, the gallery leads you into wide, open green landscapes—rolling hills dotted with trees, sprawling fields of wild grasses, and moss-covered rocks kissed by morning dew.\";}', '<p>Beyond the forest, the gallery leads you into wide, open green landscapes—rolling hills dotted with trees, sprawling fields of wild grasses, and moss-covered rocks kissed by morning dew. Each scene invites you to lose yourself in the beauty of nature’s untouched places, from quiet meadows bursting with spring colors to misty mountain trails winding through evergreen woods. These landscapes remind us of the earth’s ability to heal, inspire, and ground us, offering a tranquil escape from the demands of modern life.</p>', 1, 0, 0, 0, 0x82e8824c9b9911ef92c7a8a1598b245a, '', '', 'a:3:{i:0;s:0:\"\";i:1;s:0:\"\";i:2;s:1:\"3\";}', NULL, 0, '', 'above', NULL, '', NULL, NULL, '', 0, 0, 0, 0, 0, 'ascending', '', '', '', '', 'sourceText', NULL, NULL, 0, 0, '', '', '', '', 0, NULL, 0, 4, 0, 0, '', 0, '', '', NULL, '', '', NULL, '', NULL, '', '', '', '', 0, '', '', NULL, NULL, 0, 300, 0, 0, NULL, 0, 0, 0, 0, 0, 0, NULL, 'a:2:{i:0;s:0:\"\";i:1;s:0:\"\";}', 0, '', '', 'ascending', 0, 0, 0, 0, 0, '', NULL, 0, 'a:2:{s:5:\"value\";s:0:\"\";s:4:\"unit\";s:2:\"h2\";}', NULL, 'en', NULL, '', '', '', ''),
(553, 'image', 132, 'tl_article', 640, 1730827465, 'a:2:{s:4:\"unit\";s:2:\"h6\";s:5:\"value\";s:193:\"Whether you’re an art lover, a nature enthusiast, or simply someone seeking a moment of peace, the Nature’s Sanctuary Gallery provides a sanctuary in which to pause, breathe, and reconnect.\";}', '<p>Whether you’re an art lover, a nature enthusiast, or simply someone seeking a moment of peace, the <strong>Nature’s Sanctuary Gallery</strong> provides a sanctuary in which to pause, breathe, and reconnect with the timeless beauty of green landscapes.</p>', 1, 0, 0, 0, 0x82e882429b9911ef92c7a8a1598b245a, '', '', 'a:3:{i:0;s:0:\"\";i:1;s:0:\"\";i:2;s:1:\"3\";}', NULL, 0, '', 'above', NULL, '', NULL, NULL, '', 0, 0, 0, 0, 0, 'ascending', '', '', '', '', 'sourceText', NULL, NULL, 0, 0, '', '', '', '', 0, NULL, 0, 4, 0, 0, '', 0, '', '', NULL, '', '', NULL, '', NULL, '', '', '', '', 0, '', '', NULL, NULL, 0, 300, 0, 0, NULL, 0, 0, 0, 0, 0, 0, NULL, 'a:2:{i:0;s:0:\"\";i:1;s:0:\"\";}', 0, '', '', 'ascending', 0, 0, 0, 0, 0, '', NULL, 0, 'a:2:{s:5:\"value\";s:0:\"\";s:4:\"unit\";s:2:\"h2\";}', NULL, 'en', NULL, '', '', '', ''),
