(3, 1, 1697113635, 'New Contao Community Members each day', 0, 'new-contao-community-members-each-day', 3, 1682406900, 1682406900, '', '', NULL, 'The community is growing steadily', '<p>More and more web developers join the Contao community each day. Therefore Contao is able to evolve contantly.</p>', 1, 0, 0xcf694d76b13f11eda857525400fc3de0, '', '', 'a:3:{i:0;s:0:\"\";i:1;s:0:\"\";i:2;s:1:\"1\";}', '', 0, '', '', 1, 0x613a313a7b693a303b733a31363a2282337884a4c311e38e29000c29e44aea223b7d, 'default', 13, 0, '', 0, '', 0, 1, '', '', '', ''),
(7, 1, 1727865985, 'New Contao Versions in short intervalls', 0, 'new-contao-versions-in-short-intervalls', 1, 1684843260, 1684843260, '', 'index,follow', NULL, 'New versions of Contao are released frequently', '<p>The Contao community works hard to continuously improve Contao. Therefore several updates are released each year. The last release was Contao 3.3.</p>', 1, 1, 0xcf694d6bb13f11eda857525400fc3de0, '', '', 'a:3:{i:0;s:0:\"\";i:1;s:0:\"\";i:2;s:1:\"1\";}', '', 0, '', '', 1, 0x613a313a7b693a303b733a31363a2282337884a4c311e38e29000c29e44aea223b7d, 'default', 13, 0, '', 0, '', 0, 1, '', '', '', ''),
(8, 1, 1706727356, 'Contao is popular', 0, 'contao-is-popular', 5, 1676640420, 1676640420, '', '', NULL, 'Contao ranked in the Top5 among popular CMS&#39;s', '<p>In a recent security level comparison&nbsp;Contao excelled as one of the most secure Open Source CMS&#39;s.</p>', 0, 0, NULL, '', '', '', '', 0, '', '', 0, '', 'default', 13, 0, '', 0, '', 0, 1, '', '', '', ''),
(9, 2, 1731942864, 'Whispering Canopies: Limited Exhibits', 0, 'whispering-canopies', 7, 1730460360, 1730460360, '', '', NULL, 'Limited Edition Pieces Added!', '<p><strong>Whispering Canopies: Limited Edition Pieces Added!</strong><br>We&#39;re thrilled to announce the arrival of limited-edition pieces in the <strong>Whispering Canopies</strong> collection. These new additions showcase breathtaking trees with leaves in vibrant shades, including rare colors like turquoise and magenta. Perfect for collectors, these limited exhibits will only be available for a short time due to the high demand for this unique collection. Stop by soon to see these one-of-a-kind pieces before they&#39;re gone!</p>', 1, 0, 0x52a6ee7a984611ef92c7a8a1598b245a, '', '', 'a:3:{i:0;s:0:\"\";i:1;s:0:\"\";i:2;s:1:\"5\";}', '', 0, '', 'above', 0, NULL, 'default', 0, 0, '', 0, '', 0, 1, '', '', '', ''),
(10, 2, 1731942781, 'Veiled Horizons: Sold Out', 0, 'veiled-horizons', 7, 1730461440, 1730461440, '', '', NULL, 'Veiled Horizons - Sold Out', '<p>Thanks to overwhelming interest, our <strong>Veiled Horizons</strong> collection of mist-clouded nature scenes is officially sold out! We are grateful for the incredible response to these atmospheric works and are currently discussing plans for future pieces that bring nature’s misty allure back to the gallery. For those who missed this collection, we recommend joining our waiting list for updates on potential future releases or similar exhibits.</p>', 1, 0, 0x25e87ed1985811ef92c7a8a1598b245a, '', '', 'a:3:{i:0;s:0:\"\";i:1;s:0:\"\";i:2;s:0:\"\";}', '', 0, '', 'above', 0, NULL, 'default', 0, 0, '', 0, '', 0, 1, '', '', '', ''),
(11, 2, 1731942797, 'Flowing Tranquility', 0, 'flowing-tranquility', 7, 1730461500, 1730461500, '', '', NULL, 'New River Landscapes Available!', '<p>Our <strong>Flowing Tranquility</strong> collection has expanded with new river landscapes, showcasing beautiful views of rivers through changing seasons. These recent additions capture everything from crisp spring streams to serene winter rivers with frozen edges. We invite visitors to explore this collection and discover the peaceful beauty of rivers as they flow through diverse landscapes. Don’t miss this refreshing journey through one of nature’s most calming elements.</p>', 1, 0, 0x9d71a24f985811ef92c7a8a1598b245a, '', '', 'a:3:{i:0;s:0:\"\";i:1;s:0:\"\";i:2;s:0:\"\";}', '', 0, '', 'above', 0, NULL, 'default', 0, 0, '', 0, '', 0, 1, '', '', '', ''),
(656, 4, 1731942806, 'Flowing Tranquility', 0, 'flowing-tranquility-2', 7, 1731412680, 1731412680, '', '', NULL, 'New River Landscapes Available!', '<p>Our <strong>Flowing Tranquility</strong> collection has expanded with new river landscapes, showcasing beautiful views of rivers through changing seasons. These recent additions capture everything from crisp spring streams to serene winter rivers with frozen edges. We invite visitors to explore this collection and discover the peaceful beauty of rivers as they flow through diverse landscapes. Don’t miss this refreshing journey through one of nature’s most calming elements.</p>', 1, 0, 0x82e882129b9911ef92c7a8a1598b245a, '', '', 'a:3:{i:0;s:0:\"\";i:1;s:0:\"\";i:2;s:0:\"\";}', '', 0, '', 'above', 0, NULL, 'default', 0, 0, '', 0, '', 0, 1, '', '', '', ''),
(657, 4, 1731942812, 'Veiled Horizons: Sold Out', 0, 'veiled-horizons-2', 7, 1731412680, 1731412680, '', '', NULL, 'Veiled Horizons - Sold Out', '<p>Thanks to overwhelming interest, our <strong>Veiled Horizons</strong> collection of mist-clouded nature scenes is officially sold out! We are grateful for the incredible response to these atmospheric works and are currently discussing plans for future pieces that bring nature’s misty allure back to the gallery. For those who missed this collection, we recommend joining our waiting list for updates on potential future releases or similar exhibits.</p>', 1, 0, 0x82e8822e9b9911ef92c7a8a1598b245a, '', '', 'a:3:{i:0;s:0:\"\";i:1;s:0:\"\";i:2;s:0:\"\";}', '', 0, '', 'above', 0, NULL, 'default', 0, 0, '', 0, '', 0, 1, '', '', '', ''),
(658, 4, 1731942855, 'Whispering Canopies: Limited Exhibits', 0, 'whispering-canopies-2', 7, 1731412680, 1731412680, '', '', NULL, 'Limited Edition Pieces Added!', '<p><strong>Whispering Canopies: Limited Edition Pieces Added!</strong><br>We&#39;re thrilled to announce the arrival of limited-edition pieces in the <strong>Whispering Canopies</strong> collection. These new additions showcase breathtaking trees with leaves in vibrant shades, including rare colors like turquoise and magenta. Perfect for collectors, these limited exhibits will only be available for a short time due to the high demand for this unique collection. Stop by soon to see these one-of-a-kind pieces before they&#39;re gone!</p>', 1, 0, 0x82e8823a9b9911ef92c7a8a1598b245a, '', '', 'a:3:{i:0;s:0:\"\";i:1;s:0:\"\";i:2;s:1:\"5\";}', '', 0, '', 'above', 0, NULL, 'default', 0, 0, '', 0, '', 0, 1, '', '', '', '');

